$.OJ="\u041a\u0430\u0434\u0440\u043e\u0432\u0435 \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e \u0437 \u043f\u0456\u0434\u0431\u043e\u0440\u0443 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443 \xabHR-Library\xbb \u0437\u0434\u0456\u0439\u0441\u043d\u044e\u0454 \u043f\u043e\u0448\u0443\u043a \u043d\u0435 \u0442\u0456\u043b\u044c\u043a\u0438 \u0432 \u041a\u0438\u0454\u0432\u0456 \u0442\u0430 \u043f\u043e \u0432\u0441\u0456\u0439 \u0423\u043a\u0440\u0430\u0457\u043d\u0456, \u0430\u043b\u0435 \u0439 \u0432 \u043a\u0440\u0430\u0457\u043d\u0430\u0445 \u0421\u041d\u0414 \u0442\u0430 \u0404\u0432\u0440\u043e\u043f\u0438. \u041d\u0430\u0448\u0435 \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0437\u0443\u0454\u0442\u044c\u0441\u044f \u043d\u0430 \u043f\u043e\u0448\u0443\u043a\u0443 \u0442\u0430 \u043f\u0456\u0434\u0431\u043e\u0440\u0456 \u043a\u0432\u0430\u043b\u0456\u0444\u0456\u043a\u043e\u0432\u0430\u043d\u0438\u0445 \u043f\u0440\u0430\u0446\u0456\u0432\u043d\u0438\u043a\u0456\u0432, \u043a\u0435\u0440\u0456\u0432\u043d\u0438\u043a\u0456\u0432 \u043f\u0456\u0434\u0440\u043e\u0437\u0434\u0456\u043b\u0456\u0432 \u0442\u0430 \u0442\u043e\u043f-\u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456\u0432 \u0434\u043b\u044f \u0432\u0441\u0456\u0445 \u0433\u0430\u043b\u0443\u0437\u0435\u0439 \u0431\u0456\u0437\u043d\u0435\u0441\u0443. \u041a\u0440\u0456\u043c \u043a\u043b\u0430\u0441\u0438\u0447\u043d\u0438\u0445 \u0440\u0435\u043a\u0440\u0443\u0442\u0438\u043d\u0433\u043e\u0432\u0438\u0445 \u0456\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u0456\u0432, \u043c\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u043c\u043e \u0441\u043a\u043b\u0430\u0434\u043d\u0456 \u0445\u0430\u043d\u0442\u0438\u043d\u0433\u043e\u0432\u0456 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0456\u0457 \u0442\u0430 executive search. \u0423 \u043d\u0430\u0448\u0456\u0439 \u043a\u043e\u043c\u0430\u043d\u0434\u0456 \u043f\u0440\u0430\u0446\u044e\u044e\u0442\u044c \u0432\u0438\u043a\u043b\u044e\u0447\u043d\u043e \u0435\u043a\u0441\u043f\u0435\u0440\u0442\u0438 \u0432 \u0433\u0430\u043b\u0443\u0437\u0456 \u0440\u0435\u043a\u0440\u0443\u0442\u0438\u043d\u0433\u0443. \u041d\u0430\u044f\u0432\u043d\u0456\u0441\u0442\u044c \u043f\u0456\u0434\u0440\u043e\u0437\u0434\u0456\u043b\u0456\u0432 \u0437 \u0433\u0430\u043b\u0443\u0437\u0435\u0432\u0438\u043c\u0438 \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u044f\u043c\u0438 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u043e\u043f\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u043e \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0438 \u0442\u0430 \u043e\u0446\u0456\u043d\u044e\u0432\u0430\u0442\u0438 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b \u0437\u0430 \u0440\u0456\u0437\u043d\u0438\u043c\u0438 \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u0439\u043d\u0438\u043c\u0438 \u043d\u0430\u043f\u0440\u044f\u043c\u043a\u0430\u043c\u0438. \u0417 \u0432\u0430\u0448\u043e\u044e \u0437\u0430\u044f\u0432\u043a\u043e\u044e \u0431\u0443\u0434\u0435 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438 \u0440\u0435\u043a\u0440\u0443\u0442\u0435\u0440, \u044f\u043a\u0438\u0439 \u0437\u043d\u0430\u0454 \u0441\u043f\u0435\u0446\u0438\u0444\u0456\u043a\u0443 \u0432\u0430\u0448\u043e\u0433\u043e \u0431\u0456\u0437\u043d\u0435\u0441\u0443 \u0442\u0430 \u043c\u0430\u0454 \u043d\u0430\u043b\u0435\u0436\u043d\u0438\u0439 \u0434\u043e\u0441\u0432\u0456\u0434 \u0432 \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0456\u0439 \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u0457. \u0417\u0432\u0435\u0440\u0442\u0430\u044e\u0447\u0438\u0441\u044c \u0434\u043e \u0440\u0435\u043a\u0440\u0443\u0442\u0438\u043d\u0433\u043e\u0432\u043e\u0433\u043e \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u0430 \xabHR-Library\xbb, \u0432\u0438 \u043e\u0442\u0440\u0438\u043c\u0443\u0454\u0442\u0435 \u0434\u043e\u0441\u0432\u0456\u0434 \u0456 \u0437\u043d\u0430\u043d\u043d\u044f \u043a\u0440\u0430\u0449\u0438\u0445 \u0435\u043a\u0441\u043f\u0435\u0440\u0442\u0456\u0432 \u0433\u0430\u043b\u0443\u0437\u0456! \u0420\u0435\u043a\u0440\u0443\u0442\u0438\u043d\u0433\u043e\u0432\u0435 \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e \xabHR-Library\xbb - \u0446\u0435 \u043a\u043e\u043c\u0430\u043d\u0434\u0430 \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u043e\u043d\u0430\u043b\u0456\u0432, \u0434\u0430\u0432\u043d\u043e \u0437\u0430\u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0432\u0430\u0432\u0448\u0438\u0445 \u0441\u0435\u0431\u0435 \u0432 \u0433\u0430\u043b\u0443\u0437\u0456 \u043a\u0430\u0434\u0440\u043e\u0432\u0438\u0445 \u0440\u0456\u0448\u0435\u043d\u044c. \u041c\u0438 \u0432\u043c\u0456\u0454\u043c\u043e \u0448\u0443\u043a\u0430\u0442\u0438 \u0456 \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0438, \u043d\u0430\u0441 \u0434\u043e\u0432\u0456\u0440\u044f\u044e\u0442\u044c, \u0434\u043e \u043d\u0430\u0441 \u043f\u043e\u0432\u0435\u0440\u0442\u0430\u044e\u0442\u044c\u0441\u044f, \u043d\u0430\u0441 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u044e\u0442\u044c!"
