B.DG=A.a(s(['When writing a resume, you naturally try to show yourself in the best light. So that the future employer is seriously interested in such an employee. And the recruiting agency postponed your folder in a stack marked "Most Promising"?',"By reviewing a huge number of resumes, we were able to identify six of the most common job applicant mistakes. Get familiar with them so that your resume is perfect!","1. Sloppy, unread text","Missing commas, incorrect use of punctuation marks, misspellings is the best way to show that you do not care about the vacancy, in general, no. It doesn't matter at alldo you need to show knowledge of punctuation, spelling and style in the workplace. The thing is, a resume is your face, your suit, your everything. Yes, the main thing is to do your job well. But the position must first be won, and if earlier the applicant was met \"by clothes\", now, in the era of information technology, they are met by resume. Just imagine that a person comes to an interview in wrinkled pajamas. Would you trust him with a serious position? We don't think.","Another example. You go to an online store and see that it sells Ipone, Sasung, Nokia smartphones. Will such a seller be trusted? If he checked the texts badly, then for sure and he treats his other duties negligently, right?","Be sure to carefully read everything that you send to the employer. If correct Russian is your problem, let a philologist friend help you. In a pinch, you can always find an inexpensive proofreader or use Word's spell checker.","2. Inappropriate photo","A photo on a resume is cool. You show that you have nothing to hide: here I have told about my skills and experience, and here I am, I will be glad to work in a good company. It's captivating.","But it doesn't have to be a photo of a beach in a bathing suit or of a friendly drinking party, a photo of a playful expression or an unambiguous pose. Most often girls send inappropriate photos.","It is worth remembering that the ideal photograph is a suit close to the classic, not tense, but not cheeky pose. And yes, you need to be photographed in full face. A bikini or shorts - only for those who are casting in a modeling agency.","3. Contacts","The employer is interested in the resume, wants to discuss the terms of the future cooperation, dials the phone number.... An amazing fact: at this stage, too many candidates are eliminated. A person does not get the desired job simply because It's hard to get through to him. Two or three attempts and the candidate is eliminated.","Such embarrassment is easy to avoid: just write the time at which it is convenient for you to receive calls and leave your e-mail. The e-mail address should not be frivolous: SmeshnoyGus11, nimfetka777, ILoveSex666 are extremely unfortunate options. Get an address with a solid name. And don't forget to check your mail every day.","4. Misplaced information","At this point, most of the problems occur when specifying education and experience. Fish training courses will not help in the work of an accountant. A solid coaching experience in swamp football is not good for a law firm.","It is worth writing only about the experience that you somehow can be useful in a new workplace. You certainly have something to brag about outside the professional sphere, but take care of the man,who will fish out the necessary information from the sea of information. And remember: if the sea is too big, it may get bored with the process.","Important data is also desirable to submit concisely. Of course, two or three pages of your skills and achievements is solid. But if you talk about the main thing briefly at the very beginning of the resume, the impression will be even stronger. The ideal format is one page.","5. Vague information",'Writes, for example, the applicant Ivanov Ivan Ivanovich: "Seven years of work in leadership positions." The question arises: why no specifics? Maybe Ivanov changed jobs many times? Or the company is not listed because that the applicant has left a bad memory of himself? The more vague the information, the greater the distrust of the employer.','The more concrete the facts, the better. The line "Worked for Generation C for seven years as director of marketing"does not cause unnecessary doubts and negates the possibility of negative interpretations. The size of the company, its scope of activity is also important information for many positions (from accountants to management). Employers love it when CVs show measurable accomplishments.',"6. Bogatyrsky swing",'I apply for the positions of senior manager, manager and sales director m" - this can be written, Only when you want to hurt yourself. The message is clear: the applicant wants to be a director, but if he is offered a managerial position, he will not refuse, because the work is needed here and now. But rarely does a company need a director, whose ambitions are also satisfied by another position.',"The situation is different: you are qualified and versatile enough to apply for several positions,who are not subordinate to each other. For example, you enjoy designing, but you can also work as a copywriter. It's okay, but it's worth breaking your resume apart so that design and copywriting don't get confused."]),t.i)
