B.DV=A.a(s(['Someone goes to an interview easily, guided by the principle "as it will be, so it will be." Many perceive the interview with a recruiter as one of the most important exams on which the whole future life depends. Be that as it may, since you are going to an interview, it means that you are not indifferent to its result.',"Therefore, it would be a good idea to prepare for the upcoming interview. Before going to an interview with a recruiting agency, find out the most common questions recruiters ask.","1. Could you tell about yourself?","The main thing when answering is to maintain a balance of business and personal information. Emphasis should be placed on your work experience, education received, casually mention achievements (in passing - because you will still be allowed to speak out on this topic). You can refuse to reveal yourself from a non-professional side, but if you tell a little about your hobbies, it will be a plus. Especially if hobbies contribute to self-development. For example, you love hockey and regularly translate overseas press in Your own personal blog about the Boston Bruins is easy to pass under the sauce of 'English perfection'. Do you read modern literature? Great, following trends in different areas of life is a useful quality for any candidate.","2. What are your shortcomings and weaknesses?","The case when an honest answer will lower your points. Other applicants for the vacancy also have disadvantages, and if they don't talk about their own, and you show integrity, then nothing good will happen. The candidate told, which is a bit unpunctual. Considering his qualifications - forgivable. But maybe the purpose of the answer is to divert attention from others, Where are the more serious shortcomings? It\u2019s not just that he easily admitted that he was regularly late, \u201dalas, many recruiters would think that way.",'Therefore, answer in the style of "My shortcomings have a serious advantage: they do not affect work performance in any way."',"Our advice is to admit to a handicap that is not very significant for the position you are applying for. If the accountant says, that he can't call himself the 'life of the company' at work and is not very verbose and will easily be forgiven for that.","3. What were your achievements at your last job?","It's not bad if you really had serious achievements. But even very cool specialists should not indulge in a lengthy narrative, similar to the retelling of the myths about Hercules. Highlight the main - modest, but self-aware candidates are highly rated.","Employers like to achieve in numbers, so you can say that at the last place of work they exceeded the plan 3 times on 20% and it will be very significant.","No special achievements? It doesn't matter, dig into your memory: the options \"improved my professional skills\", 'mastered a useful program' is better than nothing.","4. Why did you leave your previous employer?","It is unacceptable to blame bad relations with colleagues and superiors - you will certainly be mistaken for a conflict person. Poor career prospects are a good reason, but only if in a new jobthese prospects will improve. A valid reason for dismissal is the relocation of the company's office to another area city or many months of salary delays. Otherwise, it's best to tell the truth. The money issue is worth mentioning,but preferably at the very end of the answer.","5. What salary will suit you?","Moving to a new job with a pay cut is nonsense. Therefore, even if the change of employer is in any way is not related to your money requests, it is worth giving a figure higher than your previous salary. Ideally, by ten or fifteen percent.","6. How do you see your professional future in five years?","A very unpleasant question for those who plan to change their field of activity in the coming yearsor, having serious ambitions, counts on a lightning-fast promotion. If there are no concrete thoughts about the professional future, it is also difficult to answer.","You should proceed from what the personnel officer wants to hear. And he will surely be satisfied with the answer, that you plan to work in the same field, although you will not refuse to help the company at a higher career level.","7. What have you heard about our company?","It's simple here. Read about the new employer, take a look at his website. Option I haven't heard much and I don't knowI just need a bigger salary - fail.","8. Why did you decide to work in our company?",'Talk a little about their pluses. "Becoming an important element in your system, the industry leader system, is my priority, "you will give me stability - what I dwaited a long time." It will be great to supplement the main story with household trifles: I\'ve been wanting to rent an apartment in the next block for a long time: the infrastructure is good there.',"Money, important as it is, should appear at the end of the answer: \"Besides, a little pay raise won't hurt me.","9. How long have you come to us?","It's tempting to say that you plan to work for such a great company for at least the next seven years,but take your time. Such an answer looks insincere and can spoil the impression of the interview.",'Optimal: "I would like to work longer, but a lot depends on whether I can successfully solve the tasks set, will I be able to realize my potential, will I fit into the team.',"10. Are you able to withstand heavy loads, do you agree to processing?","It is worth clarifying how often processing takes place, how long they take. If you're being plannedoften borrow after hours - check if overtime is paid. And based on these facts build your answer."]),t.i)
