$.b7v=A.a(["The hiring paradox during the pandemic and remote work period is the difficulty of finding specialists among a large number of applicants.","Quality recruiting is not just filling a position but finding the right specialist. A modern HR trend is to have one professional rather than a department of amateurs.","Optimizing personnel costs does not mean rejecting HR agency services but investing money with maximum benefit. Attempting to save on recruitment agency services leads to losses in the long run. The expenses for search, adaptation, training, dismissals, and turnover of incompetent staff are unproductive losses that can and should be avoided."],t.i)
$.b7u=A.a(["To recruit qualified staff, we need to:","Create a job profile for the position and create a professional job description;","Utilize all available sources, which means posting the vacancy on all available platforms and contacting candidates from open and closed resume databases. Additionally, we use our own candidate databases and other possible search channels;","Conduct a competent initial screening based on phone interviews and online testing;","Evaluate and verify candidates who have passed the initial screening and invited for a personal meeting. Our recruiters and experts conduct interviews with them at the HR-Library office;","Collect recommendations from candidates' previous employers, and verify them against all security criteria;","Select and present the best candidates to the client, justifying our choice with detailed comments;","Assist in making the final decision."],t.i)
$.b7w=A.a(["Confidentiality in project work is important!","We search everywhere, not just on two websites! We utilize databases, recommendation networks, colleagues in other recruiting agencies, direct search, forums, exhibitions, professional communities, social networks, and more than 10 specialized websites.","We conduct free labor market monitoring.","We persistently seek recommendations for each candidate from their immediate supervisor.","We love solving challenging HR tasks!"],t.i)
$.b7I=A.a(["Focus on achieving the main goals of your business without dealing with recruitment, workplace arrangements, and more.","Reduce the overall financial costs of the company.","Increase the efficiency of your enterprise through qualified specialists capable of solving complex tasks.","Free your accounting staff from the need to handle employee paperwork and payroll calculations.","Develop new business directions by freeing up human and financial resources."],t.i)
$.b7K=A.a(["Do you need true professionals for temporary but highly responsible work? Take advantage of our personnel outsourcing service, which allows you to solve the problem of finding specialists with minimal risks. We will provide the right employees for permanent, temporary, or rotational work, who will fully meet your requirements both professionally and psychologically.","Personnel outsourcing is particularly beneficial when there is a need to quickly hire a large number of specialists. In this case, all the responsibilities of hiring, training, and verifying their experience and reliability fall on our managers, giving you the opportunity to focus on your own tasks and save time."],t.i)
$.b7J=A.a(["Extensive database.","Prompt replacement of personnel.","Processing all the necessary documentation for employing the staff.","Payment based on the work performed.","By using our resources, you can quickly expand your business without significant costs. Our staffing agency provides only highly qualified personnel, selecting optimal cooperation options and compressed deadlines for fulfilling your request.","Contact us to find out the cost of personnel outsourcing in our company. The HR-LIBRARY specialists will promptly prepare an individual price list that takes into account the company's needs and your personal requirements."],t.i)
$.b78=A.a(["The headhunting methods in our agency will not cast a shadow on the client, as confidentiality is the foundation of our collaboration.","Headhunting helps companies adopt successful experiences from competitors and implement them, but if you directly poach employees, without involving an agency, you may encounter various problems.","Headhunting technologies allow for a thorough examination of candidates, creating their professional and psychological profiles, and discovering what can motivate and interest them, and what they would be willing to change jobs for.","After identifying one or two potential specialists, interviews are conducted with each of them. Poaching employees from other organizations is a troublesome and time-consuming task, but in the end, you obtain the exact professional you have been dreaming of, who meets all your criteria."],t.i)
$.b79=A.a(["Such services are often used to recruit high-level specialists, as well as those with narrow expertise and rare professions. Typically, such individuals are not interested in job site vacancies. Headhunting employs various tricks and strategies to ensure you get the person you need.","What is headhunting? It allows you to attract professionals with the necessary knowledge and experience who can bring significant benefits to your enterprise but are not actively seeking employment at the moment."],t.i)
$.b77=A.a(["Employee effectiveness guarantee - We refund the money if the employee we have selected is not performing effectively.","Speed of selection guarantee - The suitable specialist will become an employee of your company in the shortest possible time.","Employee replacement guarantee - In the event of an employee leaving during the probationary period, we will promptly find a new specialist for you free of charge."],t.i)
$.b76=A.a(["What is the cost of a specialist in the labor market?","What is the motivation system for the desired position in other organizations?","What working conditions do managers of competitor companies offer?","What is the demand and supply for the required vacancy?"],t.i)
$.b6E=A.a(["Our recruiting agency does not guarantee employment, but we will add your resume to our database.","If your skills are needed for one of the projects, we will contact you.","Be sure to indicate your salary expectations in the resume.","Services for job seekers are free."],t.i)
