$.b83=A.a(["\u041a\u043e\u0436\u043d\u043e\u043c\u0443 \u0437 \u043d\u0430\u0441 \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u0436\u0438\u0442\u0442\u044f \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0442\u0438 \u043d\u0435 \u043e\u0434\u043d\u0443 \u0441\u043f\u0456\u0432\u0431\u0435\u0441\u0456\u0434\u0443, \u043f\u0435\u0440\u0448 \u043d\u0456\u0436 \u0432\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437\u043d\u0430\u0439\u0442\u0438 \u0440\u043e\u0431\u043e\u0442\u0443, \u044f\u043a\u0430 \u043f\u043e\u0432\u043d\u043e\u044e \u043c\u0456\u0440\u043e\u044e \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u0442\u0438\u043c\u0435 \u043f\u043e\u0442\u0440\u0435\u0431\u0430\u043c \u0456 \u043e\u0447\u0456\u043a\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0456, \u044f\u043a\u043e\u044e \u043f\u0456\u0434\u0456\u0439\u0434\u0435\u0442\u0435 \u0441\u0430\u043c\u0435 \u0412\u0438. \u041d\u0435\u0440\u0456\u0434\u043a\u043e \u043f\u0440\u0438\u0447\u0438\u043d\u043e\u044e \u0442\u0440\u0438\u0432\u0430\u043b\u043e\u0433\u043e \u043f\u043e\u0448\u0443\u043a\u0443 \u0440\u043e\u0431\u043e\u0442\u0438 \u0454 \u0432\u0438\u0441\u043e\u043a\u0430 \u043a\u043e\u043d\u043a\u0443\u0440\u0435\u043d\u0446\u0456\u044f \u043d\u0430 \u0440\u0438\u043d\u043a\u0443 \u043f\u0440\u0430\u0446\u0456 \u0456 \u0442\u043e\u0439 \u0444\u0430\u043a\u0442, \u0449\u043e \u043f\u0440\u043e\u043f\u043e\u0437\u0438\u0446\u0456\u044f \u0437\u043d\u0430\u0447\u043d\u043e \u043f\u0435\u0440\u0435\u0432\u0438\u0449\u0443\u0454 \u043f\u043e\u043f\u0438\u0442. \u0422\u043e\u043c\u0443 \u0432\u0430\u0436\u043b\u0438\u0432\u043e \u0432\u043c\u0456\u0442\u0438 \xab\u043f\u0440\u043e\u0434\u0430\u0442\u0438\xbb \u0441\u0435\u0431\u0435 \u044f\u043a \u0444\u0430\u0445\u0456\u0432\u0446\u044f, \u043e\u0441\u043e\u0431\u043b\u0438\u0432\u043e \u0434\u043b\u044f \u0442\u0438\u0445, \u0445\u0442\u043e \u0447\u0438\u044f \u0440\u043e\u0431\u043e\u0442\u0430 \u043f\u043e\u0432'\u044f\u0437\u0430\u043d\u0430 \u0437 \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u0438\u043c \u0441\u043f\u0456\u043b\u043a\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0437 \u043a\u043b\u0456\u0454\u043d\u0442\u0430\u043c\u0438. ","\u0412\u043d\u0430\u0441\u043b\u0456\u0434\u043e\u043a \u0442\u043e\u0433\u043e, \u0449\u043e \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0435\u043d\u0442\u0456\u0432, \u044f\u043a\u0456 \u043f\u0435\u0440\u0435\u0431\u0443\u0432\u0430\u044e\u0442\u044c \u0443 \u043f\u043e\u0448\u0443\u043a\u0443 \u0440\u043e\u0431\u043e\u0442\u0438, \u0431\u0456\u043b\u044c\u0448\u0430, \u0447\u0438\u043c \u0432\u0430\u043a\u0430\u043d\u0442\u043d\u0438\u0445 \u043f\u043e\u0441\u0430\u0434 \u043d\u0435\u0437\u0430\u043b\u0435\u0436\u043d\u043e \u0432\u0456\u0434 \u0433\u0430\u043b\u0443\u0437\u0456 \u0447\u0438 \u043f\u043e\u0441\u0430\u0434\u0438, \u0444\u0430\u0445\u0456\u0432\u0446\u0456 \u0437 \u043f\u0456\u0434\u0431\u043e\u0440\u0443, \u0432\u0438\u043c\u0443\u0448\u0435\u043d\u0456 \u0432\u0438\u0433\u0430\u0434\u0443\u0432\u0430\u0442\u0438 \u0432\u0441\u0435 \u0431\u0456\u043b\u044c\u0448 \u0456 \u0431\u0456\u043b\u044c\u0448 \u0432\u0438\u0442\u043e\u043d\u0447\u0435\u043d\u0456 \u043f\u0438\u0442\u0430\u043d\u043d\u044f, \u0449\u043e\u0431 \u0449\u0435 \u043d\u0430 \u043f\u0435\u0440\u0448\u0438\u0445 \u0435\u0442\u0430\u043f\u0430\u0445(\u0442\u0435\u043b\u0435\u0444\u043e\u043d\u043d\u0435 \u0456\u043d\u0442\u0435\u0440\u0432'\u044e, \u0441\u043f\u0456\u0432\u0431\u0435\u0441\u0456\u0434\u0430 \u0437 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u043e\u043c \u0437 \u043f\u0456\u0434\u0431\u043e\u0440\u0443) \u0432\u0456\u0434\u0441\u0456\u044f\u0442\u0438 \u0441\u043b\u0430\u0431\u043a\u0438\u0445 \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0456\u0432. \u0422\u043e\u043c\u0443 \u0434\u0430\u043b\u0456 \u043d\u0430\u0448\u0435 \u043a\u0430\u0434\u0440\u043e\u0432\u0435 \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e \u043f\u0440\u043e\u043f\u043e\u043d\u0443\u0454 \u0440\u043e\u0437\u0433\u043b\u044f\u043d\u0443\u0442\u0438 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448 \u0441\u043a\u043b\u0430\u0434\u043d\u0456 \u043f\u0438\u0442\u0430\u043d\u043d\u044f \u0434\u043b\u044f \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0435\u043d\u0442\u0456\u0432, \u0430\u043b\u0435 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0442\u0438\u0432\u043d\u0456 \u0434\u043b\u044f \u0456\u043d\u0442\u0435\u0440\u0432'\u044e\u0435\u0440\u0430.","\u041f\u043e\u0448\u0438\u0440\u0435\u043d\u0438\u043c \u043f\u0435\u0440\u0448\u0438\u043c \u043f\u0438\u0442\u0430\u043d\u044c \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456\u0432 \u0437 \u043f\u0456\u0434\u0431\u043e\u0440\u0443 / \u043a\u0435\u0440\u0456\u0432\u043d\u0438\u043a\u0456\u0432 \u0454 \u043f\u0440\u043e\u0445\u0430\u043d\u043d\u044f \u0440\u043e\u0437\u043f\u043e\u0432\u0456\u0441\u0442\u0438 \u043f\u0440\u043e \u0441\u0435\u0431\u0435. \u041d\u0435\u0440\u0456\u0434\u043a\u043e \u043b\u044e\u0434\u0438\u043d\u0430 \u0432\u0442\u0440\u0430\u0447\u0430\u0454\u0442\u044c\u0441\u044f, \u0442\u043e\u043c\u0443 \u0449\u043e \u043d\u0435 \u0437\u043d\u0430\u0454, \u0449\u043e \u0445\u043e\u0447\u0443\u0442\u044c \u0432\u0456\u0434 \u043d\u0435\u0457 \u043f\u043e\u0447\u0443\u0442\u0438, \u043f\u0440\u043e\u0442\u0435 \u0446\u0435 \u043f\u0438\u0442\u0430\u043d\u043d\u044f \u0432\u0438\u043c\u0430\u0433\u0430\u0454 \u0432\u0456\u0434 \u0412\u0430\u0441 \u043b\u0438\u0448\u0435 \u043a\u043e\u0440\u043e\u0442\u043a\u043e\u0457, \u0430\u043b\u0435 \u0454\u043c\u043d\u043e\u0457 \u0434\u043e\u0432\u0456\u0434\u043a\u0438 \u043f\u0440\u043e \u043d\u0430\u0441\u0442\u0443\u043f\u043d\u0435: ","\u0412\u0430\u0448\u0430 \u043e\u0441\u0432\u0456\u0442\u0430, \u0440\u0456\u043a \u0437\u0430\u043a\u0456\u043d\u0447\u0435\u043d\u043d\u044f.","\u0412\u0430\u0448 \u0434\u043e\u0441\u0432\u0456\u0434 \u0440\u043e\u0431\u043e\u0442\u0438.","\u0410\u043a\u0446\u0435\u043d\u0442 \u0432 \u043e\u043f\u0438\u0441\u0456 \u0434\u043e\u0441\u0432\u0456\u0434\u0443 \u0440\u043e\u0431\u043e\u0442\u0438 \u0440\u043e\u0431\u0438\u0442\u044c\u0441\u044f \u043d\u0430 \u0442\u0438\u0445 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u044f\u0445 \u0442\u0430 \u043f\u043e\u0441\u0430\u0434\u0430\u0445, \u044f\u043a\u0456 \u043f\u043e\u0432\u043d\u0456\u0441\u0442\u044e \u0430\u0431\u043e \u0431\u0456\u043b\u044c\u0448\u043e\u044e \u043c\u0456\u0440\u043e\u044e \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u044e\u0442\u044c \u043f\u043e\u0441\u0430\u0434\u0456, \u043d\u0430 \u044f\u043a\u0443 \u0412\u0438 \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0443\u0454\u0442\u0435 \u0443 \u0446\u0456\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457. \u041f\u0440\u0438 \u0446\u044c\u043e\u043c\u0443 \u0432\u0456\u0434 \u0412\u0430\u0441 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u043e\u043a\u0440\u0435\u0441\u043b\u0438\u0442\u0438 \u043a\u043e\u043b\u043e \u0412\u0430\u0448\u0438\u0445 \u043e\u0431\u043e\u0432'\u044f\u0437\u043a\u0456\u0432 \u0442\u0430, \u043f\u043e \u043c\u043e\u0436\u043b\u0438\u0432\u043e\u0441\u0442\u0456, \u0434\u043e\u0441\u044f\u0433\u043d\u0435\u043d\u044c. \u042f\u043a\u0449\u043e \u0442\u0430\u043a\u043e\u0433\u043e \u0434\u043e\u0441\u0432\u0456\u0434\u0443 \u0431\u0430\u0433\u0430\u0442\u043e, \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u043e \u0432 \u0440\u0456\u0437\u043d\u0438\u0445 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u044f\u0445, \u0442\u043e \u0440\u043e\u0437\u043a\u0430\u0436\u0456\u0442\u044c \u043f\u0440\u043e \u043e\u0441\u0442\u0430\u043d\u043d\u0456 \u0434\u0432\u0430-\u0442\u0440\u0438 \u043c\u0456\u0441\u0446\u044f \u0440\u043e\u0431\u043e\u0442\u0438 \u0430\u0431\u043e \u043f\u0440\u043e \u0442\u0456, \u0414\u0435 \u0412\u0438 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u043b\u0438 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448 \u0442\u0440\u0438\u0432\u0430\u043b\u0438\u0439 \u0447\u0430\u0441. \u0406\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f \u043f\u0440\u043e \u0456\u043d\u0448\u0456 \u043f\u043e\u0441\u0430\u0434\u0438, \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457 \u043c\u043e\u0436\u0435 \u043d\u0430\u0434\u0430\u0432\u0430\u0442\u0438\u0441\u044f, \u0430\u043b\u0435 \u0442\u0435\u0437\u043e\u0432\u043e \u0430\u0431\u043e \u0443 \u0440\u0430\u0437\u0456, \u044f\u043a\u0449\u043e \u0443 \u0412\u0430\u0441 \u043d\u0435\u0437\u043d\u0430\u0447\u043d\u0438\u0439 \u043f\u0440\u043e\u0444\u0456\u043b\u044c\u043d\u0438\u0439 \u0434\u043e\u0441\u0432\u0456\u0434.","\u0406\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f \u0449\u043e\u0434\u043e \u043a\u0430\u0440'\u0454\u0440\u043d\u043e\u0433\u043e \u0437\u0440\u043e\u0441\u0442\u0430\u043d\u043d\u044f \u0442\u0430\u043a\u043e\u0436 \u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0442\u0435\u0437\u043e\u0432\u043e, \u044f\u043a\u0449\u043e \u0432 \u0456\u043d\u0442\u0435\u0440\u0432'\u044e\u0435\u0440\u0430 \u0432\u0438\u043d\u0438\u043a\u043d\u0443\u0442\u044c \u041f\u0438\u0442\u0430\u043d\u043d\u044f \u0447\u0438 \u0456\u043d\u0442\u0435\u0440\u0435\u0441 \u0434\u043e \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u043e\u0433\u043e \u0434\u043e\u0441\u0432\u0456\u0434\u0443/ \u043c\u0456\u0441\u0446\u044f \u0440\u043e\u0431\u043e\u0442\u0438, \u0432\u0456\u043d \u0441\u0430\u043c \u043f\u043e\u043f\u0440\u043e\u0441\u0438\u0442\u044c \u0412\u0430\u0441 \u0434\u0430\u0442\u0438 \u0440\u043e\u0437\u0433\u043e\u0440\u043d\u0443\u0442\u0443 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u044c. \u041e\u043f\u0438\u0441\u0443\u0432\u0430\u0442\u0438 \u0434\u043e\u0441\u0432\u0456\u0434 \u0440\u043e\u0431\u043e\u0442\u0438 \u043d\u0430\u043c\u0430\u0433\u0430\u0439\u0442\u0435\u0441\u044f \u0432\u0438\u0445\u043e\u0434\u044f\u0447\u0438 \u0437 \u0442\u0438\u0445 \u043e\u0431\u043e\u0432'\u044f\u0437\u043a\u0456\u0432, \u044f\u043a\u0456 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0432\u0438\u043a\u043e\u043d\u0443\u0432\u0430\u0442\u0438 \u043d\u0430 \u043d\u043e\u0432\u043e\u043c\u0443 \u043c\u0456\u0441\u0446\u0456 \u0440\u043e\u0431\u043e\u0442\u0438, \u0442\u043e\u0431\u0442\u043e. \u043f\u0435\u0440\u0435\u0444\u043e\u0440\u043c\u0443\u043b\u044e\u0439\u0442\u0435 \u043e\u0431\u043e\u0432'\u044f\u0437\u043a\u0438, \u0437\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0456 \u0432 \u043e\u043f\u0438\u0441\u0456 \u0432\u0430\u043a\u0430\u043d\u0441\u0456\u0457, \u0441\u043f\u0456\u0432\u0432\u0456\u0434\u043d\u043e\u0441\u044f\u0447\u0438 \u0437\u0456 \u0441\u0432\u043e\u0457\u043c \u0434\u043e\u0441\u0432\u0456\u0434\u043e\u043c.","\u0417\u0430\u0432\u0435\u0440\u0448\u0443\u044e\u0447\u0438 \u043f\u0440\u0435\u0437\u0435\u043d\u0442\u0430\u0446\u0456\u044e \u0441\u0432\u043e\u0433\u043e \u0434\u043e\u0441\u0432\u0456\u0434\u0443, \u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u043e\u044f\u0441\u043d\u0438\u0442\u0438 \u043f\u0440\u0438\u0447\u0438\u043d\u0438 \u043f\u043e\u0448\u0443\u043a\u0443 \u0440\u043e\u0431\u043e\u0442\u0438 \u043d\u0430 \u0434\u0430\u043d\u0438\u0439 \u043c\u043e\u043c\u0435\u043d\u0442. \u042f\u043a\u0449\u043e \u0443 \u0412\u0430\u0441 \u0454 \u0432\u0456\u0434\u0447\u0443\u0442\u0442\u044f, \u0449\u043e \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0435\u0446\u044c \u0445\u043e\u0447\u0435 \u043f\u043e\u0447\u0443\u0442\u0438 \u0432\u0456\u0434 \u0412\u0430\u0441 \u0449\u0435 \u0449\u043e\u0441\u044c, \u0430 \u0412\u0438 \u0432\u0436\u0435 \u0432\u0441\u0435 \u0440\u043e\u0437\u043f\u043e\u0432\u0456\u043b\u0438, \u0442\u0435 \u0445\u043e\u0440\u043e\u0448\u0438\u043c \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u044f\u043c \u0431\u0443\u0434\u0435 \u0441\u043a\u0430\u0437\u0430\u0442\u0438 \u043f\u0440\u043e \u0412\u0430\u0448\u0435 \u0445\u043e\u0431\u0456.","\u041e\u0442\u0440\u0438\u043c\u0430\u0432\u0448\u0438 \u043a\u043e\u0440\u043e\u0442\u043a\u0443 \u0456 \u0454\u043c\u043d\u0443 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u044c \u043d\u0430 \u043f\u0440\u043e\u0445\u0430\u043d\u043d\u044f \u0440\u043e\u0437\u043f\u043e\u0432\u0456\u0441\u0442\u0438 \u043f\u0440\u043e \u0441\u0435\u0431\u0435, \u0434\u0430\u043b\u0456 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0437\u0430\u043f\u0438\u0442\u0430\u043d\u043d\u044f, \u044f\u043a\u0456 \u0441\u0442\u043e\u0441\u0443\u044e\u0442\u044c\u0441\u044f \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448 \u0437\u043d\u0430\u0447\u0443\u0449\u0438\u0445 \u0437\u043d\u0430\u043d\u044c, \u043d\u0430\u0432\u0438\u0447\u043e\u043a, \u0443\u043c\u0456\u043d\u044c \u0432\u0438\u043a\u043e\u043d\u0443\u0432\u0430\u0442\u0438 \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u0456 \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u0439\u043d\u0456 \u0437\u0430\u0432\u0434\u0430\u043d\u043d\u044f. \u0412\u0441\u0435 \u0447\u0430\u0441\u0442\u0456\u0448\u0435 \u0434\u043b\u044f \u043f\u0440\u043e\u044f\u0441\u043d\u0435\u043d\u043d\u044f \u0434\u043e\u0441\u0432\u0456\u0434\u0443 \u0432\u0438\u0440\u0456\u0448\u0435\u043d\u043d\u044f \u0442\u0440\u0443\u0434\u043e\u0432\u0438\u0445 \u0437\u0430\u0432\u0434\u0430\u043d\u044c \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0438 \u0437 \u043f\u0456\u0434\u0431\u043e\u0440\u0443 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c \u043a\u0435\u0439\u0441\u0438,\u0442\u043e\u0431\u0442\u043e \u043c\u043e\u0434\u0435\u043b\u044e\u044e\u0442\u044c \u0440\u043e\u0431\u043e\u0447\u0443 \u0441\u0438\u0442\u0443\u0430\u0446\u0456\u044e, \u0434\u0438\u0432\u043b\u044f\u0442\u044c\u0441\u044f \u043d\u0430 \u0440\u0435\u0430\u043a\u0446\u0456\u044e, \u0440\u043e\u0431\u043b\u044f\u0442\u044c \u0432\u0438\u0441\u043d\u043e\u0432\u043a\u0438.","\u041f\u0440\u0438\u0447\u0438\u043d\u0438 \u0432\u0456\u0434\u0445\u043e\u0434\u0443 \u0437 \u043f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u044c\u043e\u0433\u043e \u043c\u0456\u0441\u0446\u044f \u0440\u043e\u0431\u043e\u0442\u0438?","\u0424\u0430\u0445\u0456\u0432\u0446\u0435\u0432\u0456, \u044f\u043a\u0438\u0439 \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u0442\u044c \u0432\u0456\u0434\u0431\u0456\u0440, \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e \u0437\u0440\u043e\u0437\u0443\u043c\u0456\u0442\u0438, \u0449\u043e \u043d\u0435 \u0432\u043b\u0430\u0448\u0442\u043e\u0432\u0443\u0432\u0430\u043b\u043e \u0412\u0430\u0441 \u043d\u0430 \u043a\u043e\u043b\u0438\u0448\u043d\u044c\u043e\u043c\u0443 \u043c\u0456\u0441\u0446\u0456 \u0456 \u0447\u043e\u0433\u043e \u043e\u0447\u0456\u043a\u0443\u0454\u0442\u0435 \u0432\u0456\u0434 \u043d\u043e\u0432\u043e\u0457 \u0440\u043e\u0431\u043e\u0442\u0438. \u0412\u0430\u0436\u043b\u0438\u0432\u043e! \u041d\u0435 \u0432\u0456\u0434\u0433\u0443\u043a\u0443\u0439\u0442\u0435\u0441\u044c \u043f\u043e\u0433\u0430\u043d\u043e \u043f\u0440\u043e \u043a\u043e\u043b\u0438\u0448\u043d\u0454 \u043a\u0435\u0440\u0456\u0432\u043d\u0438\u0446\u0442\u0432\u043e, \u043a\u043e\u043b\u0435\u0433, \u043e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0446\u0435 \u043d\u0435\u0433\u0430\u0440\u043d\u043e \u0456 \u0432\u0438\u043a\u043b\u0438\u043a\u0430\u0454 \u043f\u0456\u0434\u043e\u0437\u0440\u0443 \u043f\u0440\u043e \u0412\u0430\u0448\u0456 \u0437\u0434\u0456\u0431\u043d\u043e\u0441\u0442\u0456 \u043d\u0430\u043b\u0430\u0433\u043e\u0434\u0436\u0443\u0432\u0430\u0442\u0438 \u0432\u0437\u0430\u0454\u043c\u0438\u043d\u0438 \u0437 \u043a\u043e\u043b\u0435\u043a\u0442\u0438\u0432\u043e\u043c. \u041d\u0430\u0439\u0431\u0456\u043b\u044c\u0448 \u043f\u0440\u0438\u0439\u043d\u044f\u0442\u043d\u0438\u043c \u0431\u0443\u0434\u0435 \u0441\u043a\u0430\u0437\u0430\u0442\u0438, \u0449\u043e \u0412\u0430\u0441 \u043d\u0435 \u0432\u043b\u0430\u0448\u0442\u043e\u0432\u0443\u0432\u0430\u0432 \u0433\u0440\u0430\u0444\u0456\u043a \u0440\u043e\u0431\u043e\u0442\u0438, \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u0430\u043b\u044c\u043d\u0435 \u043c\u0456\u0441\u0446\u0435 \u0440\u043e\u0437\u0442\u0430\u0448\u0443\u0432\u0430\u043d\u043d\u044f, \u0440\u043e\u0431\u043e\u0442\u0430 \u043c\u0430\u043b\u0430 \u0440\u0443\u0442\u0438\u043d\u043d\u0438\u0439 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440, \u0431\u0443\u043b\u0438 \u0432\u0456\u0434\u0441\u0443\u0442\u043d\u0456 \u043f\u0435\u0440\u0441\u043f\u0435\u043a\u0442\u0438\u0432\u0438 \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u0439\u043d\u043e\u0433\u043e \u0442\u0430 \u043a\u0430\u0440\u0454\u0440\u043d\u043e\u0433\u043e \u0440\u043e\u0437\u0432\u0438\u0442\u043a\u0443. \u041f\u0440\u0438 \u0446\u044c\u043e\u043c\u0443 \u043a\u0440\u0430\u0449\u0435 \u0432\u0438\u0431\u0440\u0430\u0442\u0438 \u043e\u0434\u0438\u043d-\u0434\u0432\u0430 \u0444\u0430\u043a\u0442\u043e\u0440\u0438, \u044f\u043a\u0456 \u0431\u0443\u0434\u0443\u0442\u044c \u043f\u0440\u0430\u0432\u0434\u0438\u0432\u0438\u043c\u0438, \u0456 \u0432\u0456\u0434\u0441\u0443\u0442\u043d\u0456 \u0432 \u043d\u043e\u0432\u0456\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457.","\u0412 \u043e\u0441\u0442\u0430\u043d\u043d\u044e \u0447\u0435\u0440\u0433\u0443 \u0432\u0430\u0440\u0442\u043e \u0433\u043e\u0432\u043e\u0440\u0438\u0442\u0438 \u043f\u0440\u043e \u0431\u0430\u0436\u0430\u043d\u043d\u044f \u0437\u0430\u0440\u043e\u0431\u043b\u044f\u0442\u0438 \u0431\u0456\u043b\u044c\u0448\u0435, \u0434\u0430\u044e\u0447\u0438 \u0437\u0440\u043e\u0437\u0443\u043c\u0456\u0442\u0438 \u043f\u043e\u0442\u0435\u043d\u0446\u0456\u0439\u043d\u043e\u043c\u0443 \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u044e,\u0429\u043e \u0433\u0440\u043e\u0448\u0456 \u2014 \u0446\u0435 \u043d\u0435 \u043d\u0430\u0439\u0433\u043e\u043b\u043e\u0432\u043d\u0456\u0448\u0435 \u0432 \u0440\u043e\u0431\u043e\u0442\u0456. \u041e\u0434\u043d\u0430\u043a, \u044f\u043a\u0449\u043e \u0412\u0438 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0437 \u043f\u0440\u043e\u0434\u0430\u0436\u0443, \u0442\u043e \u043f\u0440\u0438\u0439\u043d\u044f\u0442\u043d\u043e \u0432 \u043f\u0435\u0440\u0448\u0443 \u0447\u0435\u0440\u0433\u0443 \u043d\u0430\u0433\u043e\u043b\u043e\u0448\u0443\u0432\u0430\u0442\u0438 \u043d\u0430 \u043c\u043e\u0436\u043b\u0438\u0432\u043e\u0441\u0442\u0456 \u043e\u0442\u0440\u0438\u043c\u0443\u0432\u0430\u0442\u0438 \u0431\u0456\u043b\u044c\u0448\u0435, \u0442\u043e\u043c\u0443 \u0449\u043e \u0412\u0430\u0448\u0435 \u0433\u043e\u043b\u043e\u0432\u043d\u0435 \u0437\u0430\u0432\u0434\u0430\u043d\u043d\u044f \u043f\u0440\u0438\u043d\u043e\u0441\u0438\u0442\u0438 \u0432 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u044e \u044f\u043a\u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u0435 \u0433\u0440\u043e\u0448\u0435\u0439. \u0412\u0456\u0434\u0441\u0443\u0442\u043d\u0456\u0441\u0442\u044c \u043c\u043e\u0436\u043b\u0438\u0432\u043e\u0441\u0442\u0435\u0439 \u0443 \u043f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u0456\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457 \u043d\u0430\u0440\u043e\u0449\u0443\u0432\u0430\u0442\u0438 \u043e\u0431\u043e\u0440\u043e\u0442\u0438 \u0437 \u043f\u0440\u043e\u0434\u0430\u0436\u0443 \u0456 \u0442\u0438\u043c \u0441\u0430\u043c\u0438\u043c \u0441\u0432\u0456\u0439 \u0434\u043e\u0445\u0456\u0434 \u0434\u043b\u044f \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456\u0432 \u0454 \u043f\u043e\u0432\u0430\u0436\u043d\u043e\u044e \u043f\u0440\u0438\u0447\u0438\u043d\u043e\u044e \u0437\u043c\u0456\u043d\u0438 \u0440\u043e\u0431\u043e\u0442\u0438.","\u0417\u0430\u0432\u0435\u0440\u0448\u0443\u044e\u0447\u0438 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u044c \u043d\u0430 \u0446\u0435 \u043f\u0438\u0442\u0430\u043d\u043d\u044f, \u0449\u043e\u0431 \u0437\u043d\u044f\u0442\u0438 \u0443 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u043f\u043e \u043f\u0456\u0434\u0431\u043e\u0440\u0443 \u0431\u0443\u0434\u044c-\u044f\u043a\u0456 \u0441\u0443\u043c\u043d\u0456\u0432\u0438 \u0443 \u0412\u0430\u0448\u0456\u0439 \u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0442\u043d\u043e\u0441\u0442\u0456, \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u043e\u043d\u0430\u043b\u0456\u0437\u043c, \u043d\u0435\u043a\u043e\u043d\u0444\u043b\u0456\u043a\u0442\u043d\u0456\u0441\u0442\u044c \u0456 \u0442.\u0434. \u0441\u043a\u0430\u0436\u0456\u0442\u044c, \u0449\u043e \u0433\u043e\u0442\u043e\u0432\u0456 \u043d\u0430\u0434\u0430\u0442\u0438 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0430\u0446\u0456\u0457 \u0437 \u043e\u0441\u0442\u0430\u043d\u043d\u0456\u0445 \u043c\u0456\u0441\u0446\u044c \u0440\u043e\u0431\u043e\u0442\u0438 \u0432\u0456\u0434 \u0431\u0435\u0437\u043f\u043e\u0441\u0435\u0440\u0435\u0434\u043d\u0456\u0445 \u043a\u0435\u0440\u0456\u0432\u043d\u0438\u043a\u0456\u0432, \u0410\u041b\u0415 \u0431\u0443\u0434\u044c\u0442\u0435 \u0432\u043f\u0435\u0432\u043d\u0435\u043d\u0456, \u0449\u043e \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0430\u0446\u0456\u0457 \u0434\u0430\u0434\u0443\u0442\u044c \u0434\u0456\u0439\u0441\u043d\u043e \u043f\u043e\u0437\u0438\u0442\u0438\u0432\u043d\u0456!","\u0412\u0430\u0448\u0456 \u043e\u0447\u0456\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0449\u043e\u0434\u043e \u0437\u0430\u0440\u043e\u0431\u0456\u0442\u043d\u043e\u0457 \u043f\u043b\u0430\u0442\u0438?\u0414\u043e\u0441\u0438\u0442\u044c \u0443\u0441\u043f\u0456\u0448\u043d\u043e\u044e \u0454 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u044c, \u0449\u043e \u0437\u0430\u0440\u043e\u0431\u0456\u0442\u043d\u0430 \u043f\u043b\u0430\u0442\u0430 \u043f\u043e\u0432\u0438\u043d\u043d\u0430 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u0442\u0438 \u0442\u0438\u043c \u043e\u0431\u043e\u0432'\u044f\u0437\u043a\u0430\u043c, \u044f\u043a\u0456 \u0431\u0443\u0434\u0443\u0442\u044c \u043d\u0430 \u0412\u0430\u0441 \u043f\u043e\u043a\u043b\u0430\u0434\u0435\u043d\u0456. \u041e\u0434\u043d\u0430\u043a \u043f\u043e\u0442\u0435\u043d\u0446\u0456\u0439\u043d\u0438\u0439 \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0435\u0446\u044c \u043f\u043e\u0432\u0438\u043d\u0435\u043d \u0440\u043e\u0437\u0443\u043c\u0456\u0442\u0438 \u0442\u0438, \u0447\u0438 \u0437\u043c\u043e\u0436\u0435 \u0432\u0456\u043d \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0438\u0442\u0438 \u0412\u0430\u0441 \u0442\u0438\u043c\u0438 \u0434\u043e\u0445\u043e\u0434\u0430\u043c\u0438, \u043d\u0430 \u044f\u043a\u0456 \u0412\u0438 \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0443\u0454\u0442\u0435. \u0422\u043e\u043c\u0443 \u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u043e\u0437\u043d\u0430\u0447\u0438\u0442\u0438 \u0434\u043e\u0445\u0456\u0434 \u043d\u0430 \u043e\u0441\u0442\u0430\u043d\u043d\u044c\u043e\u043c\u0443 \u043c\u0456\u0441\u0446\u0456 \u0440\u043e\u0431\u043e\u0442\u0438 \u044f\u043a \u043c\u0456\u043d\u0456\u043c\u0430\u043b\u044c\u043d\u0438\u0439, \u0430 \u0431\u0430\u0436\u0430\u043d\u0438\u0439 \u0432\u0438\u0449\u0435 \u043d\u0430 20-30%. \u0410\u043b\u0435 \u043d\u0435 \u0437\u0430\u0431\u0443\u0432\u0430\u0439\u0442\u0435 \u043f\u0440\u043e \u0442\u0435, \u0449\u043e \u0412\u0430\u0448\u0456 \u043e\u0447\u0456\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u043d\u0435 \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u0437\u043d\u0430\u0447\u043d\u043e \u043f\u0435\u0440\u0435\u0432\u0438\u0449\u0443\u0432\u0430\u0442\u0438 \u0442\u0443 \u0441\u0443\u043c\u0443, \u044f\u043a\u0443 \u0437\u043c\u043e\u0436\u0435 \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0438\u0442\u0438 \u043d\u043e\u0432\u0430 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u044f.","\u0420\u043e\u0437\u043a\u0430\u0436\u0456\u0442\u044c \u043f\u0440\u043e \u0412\u0430\u0448\u0456 \u043d\u0435\u0434\u043e\u043b\u0456\u043a\u0438?","\u0412\u0441\u0456 \u043b\u044e\u0434\u0438 \u0456 \u0443 \u043a\u043e\u0436\u043d\u043e\u0433\u043e \u0454 \u043d\u0435\u0434\u043e\u043b\u0456\u043a\u0438. \u0412\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u0442\u0438 \u0447\u0435\u0441\u043d\u043e \u043d\u0430 \u0446\u0435 \u043f\u0438\u0442\u0430\u043d\u043d\u044f \u043d\u0435 \u0432\u0430\u0440\u0442\u043e, \u043d\u0430\u0439\u043a\u0440\u0430\u0449\u0435 \u0443\u0445\u0438\u043b\u0438\u0442\u044c\u0441\u044f \u0432\u0456\u0434 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0456, \u0421\u043a\u0430\u0437\u0430\u0432\u0448\u0438, \u0449\u043e \u0443 \u0412\u0430\u0441 \u0432\u0456\u0434\u0441\u0443\u0442\u043d\u0456 \u043d\u0435\u0434\u043e\u043b\u0456\u043a\u0438, \u044f\u043a\u0456 \u0437\u0430\u0432\u0430\u0436\u0430\u0442\u0438\u043c\u0443\u0442\u044c \u0412\u0430\u0448\u0456\u0439 \u0440\u043e\u0431\u043e\u0442\u0456. \u0410\u0431\u043e \u043c\u043e\u0436\u043d\u0430 \u0432\u0456\u0434\u0431\u0443\u0442\u0438\u0441\u044f \u0436\u0430\u0440\u0442\u0430\u043c\u0438, \u0441\u043a\u0430\u0437\u0430\u0432\u0448\u0438, \u0449\u043e \u0434\u043b\u044f \u0412\u0430\u0441 \u0456\u043d\u043e\u0434\u0456 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u043d\u043e \u0432\u0442\u0440\u0430\u0447\u0430\u0442\u0438 \u0445\u0456\u0434 \u0447\u0430\u0441\u0443, \u0437\u0430\u0445\u043e\u043f\u0438\u0432\u0448\u0438\u0441\u044c \u0440\u043e\u0431\u043e\u0442\u043e\u044e.","\u042f\u043a\u0456 \u0434\u043e\u0441\u044f\u0433\u043d\u0435\u043d\u043d\u044f \u0431\u0443\u043b\u0438 \u0443 \u0412\u0430\u0441 \u043d\u0430 \u043f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u0456\u0439 \u0440\u043e\u0431\u043e\u0442\u0456?","\u0426\u0435 \u043f\u0438\u0442\u0430\u043d\u043d\u044f \u0432\u0438\u043c\u0430\u0433\u0430\u0454 \u0432\u0456\u0434 \u0412\u0430\u0441 \u0437\u043d\u043e\u0432\u0443 \u043a\u043e\u0440\u043e\u0442\u043a\u043e\u0457, \u0430\u043b\u0435 \u0454\u043c\u043d\u043e\u0457 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0456. \u0420\u043e\u0437\u043a\u0430\u0436\u0456\u0442\u044c \u043f\u0440\u043e \u0442\u0435, \u0449\u043e \u0443\u0441\u043f\u0456\u0448\u043d\u043e \u0440\u0435\u0430\u043b\u0456\u0437\u0443\u0432\u0430\u043b\u0438 \u043f\u0440\u043e\u0435\u043a\u0442, \u043f\u0440\u0438\u0432\u0435\u043b\u0438 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u0437\u0430\u043c\u043e\u0432\u043d\u0438\u043a\u0430, \u0437\u0431\u0456\u043b\u044c\u0448\u0438\u043b\u0438 \u043e\u0431\u0441\u044f\u0433 \u043f\u0440\u043e\u0434\u0430\u0436\u0443 \u0442\u043e\u0449\u043e. \u041c\u043e\u0436\u0435\u0442\u0435 \u043f\u0456\u0434\u043a\u0440\u0456\u043f\u0438\u0442\u0438 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u044c \u0456\u043b\u044e\u0441\u0442\u0440\u0430\u0446\u0456\u0454\u044e \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u043e\u0433\u043e \u0434\u043e\u0441\u044f\u0433\u043d\u0435\u043d\u043d\u044f, \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, \u043f\u0440\u043e\u0432\u0456\u0432\u0448\u0438 \u0443\u0441\u043f\u0456\u0448\u043d\u0456 \u043f\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0440\u0438 \u0437 \u043a\u043b\u0456\u0454\u043d\u0442\u043e\u043c \xabN\xbb \u0412\u0430\u043c \u0432\u0434\u0430\u043b\u043e\u0441\u044f \u0443\u043a\u043b\u0430\u0441\u0442\u0438 \u0434\u043e\u0433\u043e\u0432\u0456\u0440 \u043f\u0440\u043e \u043f\u0440\u043e\u0434\u0430\u0436 \u0442\u043e\u0432\u0430\u0440\u0456\u0432 \u043d\u0430 \u0441\u0443\u043c\u0443 \xab\u0425\xbb, \u0449\u043e \u0440\u0430\u043d\u0456\u0448\u0435 \u043d\u0435 \u0432\u0434\u0430\u0432\u0430\u043b\u043e\u0441\u044f \u043d\u0456\u043a\u043e\u043c\u0443 \u0456\u0437 \u0441\u043f\u0456\u0432\u0440\u043e\u0431\u0456\u0442\u043d\u0438\u043a\u0456\u0432.","\u042f\u043a \u0412\u0438 \u0441\u0442\u0430\u0432\u0438\u0442\u0435\u0441\u044f \u0434\u043e \u0432\u0438\u0441\u043e\u043a\u043e\u0456\u043d\u0442\u0435\u043d\u0441\u0438\u0432\u043d\u043e\u0457 \u0440\u043e\u0431\u043e\u0442\u0438, \u043f\u0435\u0440\u0435\u0440\u043e\u0431\u043e\u043a?;","\u0414\u043b\u044f \u043f\u043e\u0447\u0430\u0442\u043a\u0443 \u0443\u0442\u043e\u0447\u043d\u0456\u0442\u044c, \u0449\u043e \u0441\u0430\u043c\u0435 \u043c\u0430\u0454\u0442\u044c\u0441\u044f \u043d\u0430 \u0443\u0432\u0430\u0437\u0456 \u043f\u0456\u0434 \u0434\u0430\u043d\u0438\u043c \u043f\u0438\u0442\u0430\u043d\u043d\u044f\u043c. \u0427\u0438 \u0434\u043e\u0432\u0435\u0434\u0435\u0442\u044c\u0441\u044f \u0412\u0430\u043c \u0441\u0438\u0434\u0456\u0442\u0438 \u0434\u043e \u043f\u0456\u0432\u043d\u043e\u0447\u0456 \u0430\u0431\u043e \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438 \u043e\u0434\u043d\u043e\u043c\u0443 \u0437\u0430 \u0446\u0456\u043b\u0438\u0439 \u0432\u0456\u0434\u0434\u0456\u043b? \u042f\u043a\u0449\u043e \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u044c \u0442\u0430 \u0443\u043c\u043e\u0432\u0438 \u043f\u0440\u0438\u0439\u043d\u044f\u0442\u043d\u0456 \u0434\u043b\u044f \u0412\u0430\u0441, \u0442\u043e \u0441\u043a\u0430\u0436\u0456\u0442\u044c, \u0449\u043e \u043c\u0430\u043b\u0438 \u0434\u043e\u0441\u0432\u0456\u0434 \u0440\u043e\u0431\u043e\u0442\u0438 \u0432 \u0430\u043d\u0430\u043b\u043e\u0433\u0456\u0447\u043d\u0438\u0445 \u0443\u043c\u043e\u0432\u0430\u0445, \u0456 \u0443\u0441\u043f\u0456\u0448\u043d\u043e \u0441\u043f\u0440\u0430\u0432\u043b\u044f\u043b\u0438\u0441\u044f.","\u0429\u043e \u0432\u0438 \u0437\u043d\u0430\u0454\u0442\u0435 \u043f\u0440\u043e \u043d\u0430\u0448\u0443 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u044e \u0456 \u0447\u043e\u0433\u043e \u043e\u0447\u0456\u043a\u0443\u0454\u0442\u0435 \u0432\u0456\u0434 \u0440\u043e\u0431\u043e\u0442\u0438?","\u042f\u043a\u0449\u043e \u0412\u0438 \u0439\u0434\u0435\u0442\u0435 \u043d\u0430 \u0441\u043f\u0456\u0432\u0431\u0435\u0441\u0456\u0434\u0443 \u0431\u0435\u0437\u043f\u043e\u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e \u0434\u043e \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u044f, \u0442\u043e \u0437\u043e\u0431\u043e\u0432'\u044f\u0437\u0430\u043d\u0456 \u0437\u0430\u0437\u0434\u0430\u043b\u0435\u0433\u0456\u0434\u044c \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u043d\u0443\u0442\u0438 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043f\u0440\u043e \u043d\u044c\u043e\u0433\u043e: \u0427\u0438\u043c \u0437\u0430\u0439\u043c\u0430\u0454\u0442\u044c\u0441\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u044f, \u044f\u043a \u0434\u0430\u0432\u043d\u043e \u043d\u0430 \u0440\u0438\u043d\u043a\u0443, \u043f\u0435\u0440\u0435\u0432\u0430\u0433\u0438 \u0456 \u0442.\u0434. \u041f\u043e\u0448\u0443\u043a \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u0437\u0430\u0437\u0434\u0430\u043b\u0435\u0433\u0456\u0434\u044c \u043d\u0435 \u0442\u0456\u043b\u044c\u043a\u0438 \u0434\u043e\u043f\u043e\u043c\u043e\u0436\u0435 \u0443\u0441\u043f\u0456\u0448\u043d\u043e \u043f\u0440\u043e\u0439\u0442\u0438 \u0421\u043f\u0456\u0432\u0431\u0435\u0441\u0456\u0434\u0430, \u0430\u043b\u0435 \u0439 \u0443 \u0434\u0435\u044f\u043a\u0438\u0445 \u0432\u0438\u043f\u0430\u0434\u043a\u0430\u0445 \u043d\u0435 \u0432\u0438\u0442\u0440\u0430\u0442\u0438\u0442\u0438 \u0447\u0430\u0441 \u043d\u0430 \u043f\u043e\u0457\u0437\u0434\u043a\u0443 \u0434\u043e \u043d\u0435\u0434\u043e\u0431\u0440\u043e\u0441\u043e\u0432\u0456\u0441\u043d\u043e\u0433\u043e \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u044f. \u041e\u0447\u0456\u043a\u0443\u0432\u0430\u043d\u043d\u044f, \u044f\u043a\u0456 \u0412\u0438 \u043e\u0437\u0432\u0443\u0447\u0438\u0442\u0435, \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u0442\u0438 \u0442\u0438\u043c \u043c\u043e\u0436\u043b\u0438\u0432\u043e\u0441\u0442\u044f\u043c, \u044f\u043a\u0456 \u043c\u043e\u0436\u0435 \u043d\u0430\u0434\u0430\u0442\u0438 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u044f, \u0442\u043e\u0431\u0442\u043e. \u0412\u0438 \u043e\u0447\u0456\u043a\u0443\u0454\u0442\u0435, \u0449\u043e \u0440\u0435\u0430\u043b\u0456\u0437\u043e\u0432\u0443\u0432\u0430\u0442\u0438\u043c\u0435\u0442\u0435 \u0441\u0432\u0456\u0439 \u043f\u043e\u0442\u0435\u043d\u0446\u0456\u0430\u043b, \u0432\u0438\u043a\u043e\u043d\u0443\u044e\u0447\u0438 \u043e\u0431\u043e\u0432'\u044f\u0437\u043a\u0438 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u0456 \u043f\u043e\u0441\u0430\u0434\u0438 \u0432 \u0434\u0430\u043d\u0456\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457.","\u042f\u043a \u0434\u043e\u0432\u0433\u043e \u0412\u0438 \u043f\u0440\u0438\u043f\u0443\u0441\u043a\u0430\u0454\u0442\u0435 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438 \u0432 \u0434\u0430\u043d\u0456\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457?","\u0411\u0435\u0437\u0443\u043c\u043e\u0432\u043d\u043e, \u0412\u0438 \u043c\u0430\u0454\u0442\u0435 \u043d\u0430\u043c\u0456\u0440 \u043f\u0440\u043e\u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438 \u0432 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457 \u044f\u043a\u043e\u043c\u043e\u0433\u0430 \u0434\u043e\u0432\u0448\u0435. \u0420\u043e\u0437\u0440\u0430\u0445\u043e\u0432\u0443\u0454\u0442\u0435 \u043d\u0430 \u0442\u0435, \u0449\u043e \u0412\u0438 \u043c\u0430\u0442\u0438\u043c\u0435\u0442\u0435 \u043c\u043e\u0436\u043b\u0438\u0432\u0456\u0441\u0442\u044c \u0440\u043e\u0437\u0432\u0438\u0432\u0430\u0442\u0438\u0441\u044f \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u0439\u043d\u043e \u0456, \u044f\u043a\u0449\u043e \u043f\u043e\u0441\u0430\u0434\u0430 \u0446\u0435 \u043c\u0430\u0454 \u043d\u0430 \u0443\u0432\u0430\u0437\u0456, \u0440\u043e\u0441\u0442\u0438 \u043a\u0430\u0440'\u0454\u0440\u043d\u0438\u043c\u0438 \u0441\u0445\u043e\u0434\u0430\u043c\u0438. \u041f\u0440\u0438 \u0446\u044c\u043e\u043c\u0443 \u0412\u0438 \u0440\u043e\u0437\u0443\u043c\u0456\u0454\u0442\u0435, \u0449\u043e \u0442\u0430\u043a\u043e\u0436 \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e \u043f\u043e\u0437\u043d\u0430\u0439\u043e\u043c\u0438\u0442\u0438\u0441\u044f \u0437 \u043a\u043e\u043b\u0435\u043a\u0442\u0438\u0432\u043e\u043c \u0442\u0430 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0454\u044e \u0437\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0438, \u043d\u0430 \u043f\u0440\u0430\u043a\u0442\u0438\u0446\u0456 \u0437\u0440\u043e\u0437\u0443\u043c\u0456\u0442\u0438 \u043d\u0430\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0437\u0434\u0456\u0439\u0441\u043d\u0435\u043d\u043d\u0456 \u0442\u0430 \u0446\u0456\u043a\u0430\u0432\u0456\u043f\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0456 \u0437\u0430\u0432\u0434\u0430\u043d\u043d\u044f, \u043f\u0435\u0440\u0448 \u043d\u0456\u0436 \u0433\u043e\u0432\u043e\u0440\u0438\u0442\u0438, \u0449\u043e \u0412\u0438 \u0433\u043e\u0442\u043e\u0432\u0456 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438 \u0432 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457 \u0442\u0440\u0438\u0432\u0430\u043b\u0438\u0439 \u043f\u0435\u0440\u0456\u043e\u0434 \u0447\u0430\u0441\u0443.","\u0427\u0438\u043c \u0412\u0430\u0441 \u0437\u0430\u0446\u0456\u043a\u0430\u0432\u0438\u043b\u0430 \u0440\u043e\u0431\u043e\u0442\u0430 \u0441\u0430\u043c\u0435 \u0432 \u0434\u0430\u043d\u0456\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457?","\u0414\u043e\u0440\u0435\u0447\u043d\u043e \u0441\u043a\u0430\u0437\u0430\u0442\u0438 \u043f\u0440\u043e \u0441\u0442\u0430\u0431\u0456\u043b\u044c\u043d\u0456\u0441\u0442\u044c \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457, \u0457\u0457 \u043d\u0430\u0434\u0456\u0439\u043d\u0456\u0441\u0442\u044c, \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u0456\u0441\u0442\u044c, \u043f\u0440\u043e\u043f\u043e\u043d\u043e\u0432\u0430\u043d\u0456 \u043f\u0435\u0440\u0441\u043f\u0435\u043a\u0442\u0438\u0432\u0438 \u0437\u0440\u043e\u0441\u0442\u0430\u043d\u043d\u044f \u0456 \u0440\u043e\u0437\u0432\u0438\u0442\u043a\u0443 \u0441\u043f\u0456\u0432\u0440\u043e\u0431\u0456\u0442\u043d\u0438\u043a\u0456\u0432, \u0446\u0456\u043a\u0430\u0432\u043e\u0457 \u0433\u0430\u043b\u0443\u0437\u0456 \u0440\u043e\u0431\u043e\u0442\u0438 \u0442\u0430 \u0437\u0430\u0434\u0430\u0447\u0430\u0445, \u043f\u0440\u043e\u043f\u043e\u043d\u043e\u0432\u0430\u043d\u0438\u0445 \u0443\u043c\u043e\u0432\u0430\u0445. \u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u043d\u0430\u0437\u0432\u0430\u0442\u0438 \u043a\u0456\u043b\u044c\u043a\u0430 \u043a\u0440\u0438\u0442\u0435\u0440\u0456\u0457\u0432, \u0433\u043e\u043b\u043e\u0432\u043d\u0435 \u043d\u0435 \u0437\u0430\u0431\u0443\u0432\u0430\u0442\u0438 \u043f\u0440\u043e \u0442\u0435, \u0449\u043e \u0432\u043e\u043d\u0438 \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u0442\u0438 \u0440\u0435\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0456.","\u041d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e \u043f\u0430\u043c'\u044f\u0442\u0430\u0442\u0438 \u043f\u0456\u0434 \u0447\u0430\u0441 \u0440\u043e\u0437\u043c\u043e\u0432\u0438 \u0437 \u043a\u0435\u0440\u0456\u0432\u043d\u0438\u043a\u043e\u043c/ \u0444\u0430\u0445\u0456\u0432\u0446\u0435\u043c \u0437 \u043f\u0456\u0434\u0431\u043e\u0440\u0443, \u0449\u043e \u0432\u0441\u0456 \u0457\u0445\u043d\u0456 \u043f\u0438\u0442\u0430\u043d\u043d\u044f \u0441\u043f\u0440\u044f\u043c\u043e\u0432\u0430\u043d\u0456 \u043d\u0430 \u0442\u0435, \u0449\u043e\u0431 \u0432\u0438\u044f\u0432\u0438\u0442\u0438 \u043a\u0440\u0430\u0449\u043e\u0433\u043e \u0444\u0430\u0445\u0456\u0432\u0446\u044f, \u044f\u043a\u0438\u0439 \u0433\u043e\u0442\u043e\u0432\u0438\u0439 \u0434\u043e \u0442\u0440\u0438\u0432\u0430\u043b\u043e\u0457 \u0442\u0430 \u043f\u043b\u0456\u0434\u043d\u043e\u0457 \u0441\u043f\u0456\u0432\u043f\u0440\u0430\u0446\u0456. \u041a\u0440\u0456\u043c \u0442\u043e\u0433\u043e, \u0412\u0438 \u044f\u043a \u043f\u043e\u0442\u0435\u043d\u0446\u0456\u0439\u043d\u0438\u0439 \u0441\u043f\u0456\u0432\u0440\u043e\u0431\u0456\u0442\u043d\u0438\u043a \u0442\u0435\u0436 \u043c\u043e\u0436\u0435\u0442\u0435 \u043e\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043f\u0440\u043e \u043c\u0430\u0439\u0431\u0443\u0442\u043d\u044c\u043e\u0433\u043e \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u044f \u0430\u043d\u0430\u043b\u0456\u0437\u0443\u044e\u0447\u0438 \u043f\u0438\u0442\u0430\u043d\u043d\u044f.","\u0422\u0430\u043a \u044f\u043a\u0449\u043e \u0412\u0430\u043c \u0441\u0442\u0430\u0432\u043b\u044f\u0442\u044c \u0431\u0430\u0433\u0430\u0442\u043e \u0441\u0435\u0440\u0439\u043e\u0437\u043d\u0438\u0445 \u043f\u0438\u0442\u0430\u043d\u044c \u0449\u043e\u0434\u043e \u0412\u0430\u0448\u0438\u0445 \u0437\u043d\u0430\u043d\u044c \u0442\u0430 \u0432\u043c\u0456\u043d\u044c, \u0442\u043e \u043f\u043e\u0442\u0440\u0430\u043f\u0438\u0432\u0448\u0438 \u043d\u0430 \u0440\u043e\u0431\u043e\u0442\u0443 \u0434\u043e \u0446\u0456\u0454\u0457 \u043e\u0440\u0433\u0430\u043d\u0456\u0437\u0430\u0446\u0456\u0457, \u0412\u0438 \u043e\u043f\u0438\u043d\u0438\u0442\u0435\u0441\u044f \u0441\u0435\u0440\u0435\u0434 \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u043e\u043d\u0430\u043b\u0456\u0432. \u042f\u043a\u0449\u043e \u043d\u0430 \u0441\u043f\u0456\u0432\u0431\u0435\u0441\u0456\u0434\u0456 \u043f\u0440\u0438\u0434\u0456\u043b\u044f\u0454\u0442\u044c\u0441\u044f \u043d\u0430\u043b\u0435\u0436\u043d\u0430 \u0443\u0432\u0430\u0433\u0430 \u0412\u0430\u043c \u044f\u043a \u043b\u044e\u0434\u0438\u043d\u0456, \u0442\u043e \u0432 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457 \u0441\u043e\u0446\u0456\u0430\u043b\u044c\u043d\u043e-\u043f\u0441\u0438\u0445\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0438\u0439 \u043a\u043b\u0456\u043c\u0430\u0442 \u0456 \u0442.\u0434. \u041d\u0430 \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u044f \u0440\u043e\u0437\u043c\u043e\u0432\u0438 \u0434\u043e\u0440\u0435\u0447\u043d\u043e \u0456 \u0440\u043e\u0437\u0443\u043c\u043d\u043e \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u0438 \u0441\u0432\u043e\u0457 \u0437\u0430\u043f\u0438\u0442\u0430\u043d\u043d\u044f, \u0442\u0438\u043c \u0441\u0430\u043c\u0438\u043c \u0412\u0438 \u043f\u043e\u043a\u0430\u0436\u0435\u0442\u0435, \u0449\u043e \u0437\u0430\u0446\u0456\u043a\u0430\u0432\u043b\u0435\u043d\u0456 \u0432 \u0440\u043e\u0431\u043e\u0442\u0456, \u0443\u0432\u0430\u0436\u043d\u0456 \u043f\u0440\u0438 \u0432\u0438\u0431\u043e\u0440\u0456 \u043c\u0430\u0439\u0431\u0443\u0442\u043d\u044c\u043e\u0433\u043e \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u044f, \u0430 \u0441\u0442\u0430\u0432\u043b\u044f\u0447\u0438 \u043f\u0438\u0442\u0430\u043d\u043d\u044f \u0449\u043e\u0434\u043e \u043d\u044e\u0430\u043d\u0441\u0456\u0432 \u0440\u043e\u0431\u043e\u0442\u0438, \u043c\u043e\u0436\u0435\u0442\u0435 \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u043e \u043f\u0456\u0434\u043a\u0440\u0435\u0441\u043b\u0438\u0442\u0438 \u043a\u0432\u0430\u043b\u0456\u0444\u0456\u043a\u0430\u0446\u0456\u044e.","\u041d\u0430 \u0437\u0430\u043a\u0456\u043d\u0447\u0435\u043d\u043d\u044f \u0445\u043e\u0447\u0443 \u0434\u0430\u0442\u0438 \u043a\u0456\u043b\u044c\u043a\u0430 \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0430\u043b\u044c\u043d\u0438\u0445 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0430\u0446\u0456\u0439 \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0435\u043d\u0442\u0430\u043c, \u043e\u0441\u043e\u0431\u043b\u0438\u0432\u043e \u0432\u043e\u043d\u0438 \u043a\u043e\u0440\u0438\u0441\u043d\u0456 \u0442\u0438\u043c \u0445\u0442\u043e \u043d\u0435 \u043c\u0430\u0454 \u0434\u043e\u0441\u0432\u0456\u0434\u0443\u043f\u0440\u043e\u0445\u043e\u0434\u0436\u0435\u043d\u043d\u044f \u0441\u043f\u0456\u0432\u0431\u0435\u0441\u0456\u0434 \u0456 \u0442\u0438\u043c \u0443 \u043a\u043e\u0433\u043e \u0432\u0456\u043d \u043d\u0435\u0433\u0430\u0442\u0438\u0432\u043d\u0438\u0439.","\u0424\u0430\u0445\u0456\u0432\u0446\u0456 \u0437 \u043f\u0456\u0434\u0431\u043e\u0440\u0443 \u0442\u0430 \u043a\u0435\u0440\u0456\u0432\u043d\u0438\u043a\u0438 \u0432\u0456\u0434\u0434\u0430\u044e\u0442\u044c \u043f\u0435\u0440\u0435\u0432\u0430\u0433\u0443 \u0430\u043a\u0442\u0438\u0432\u043d\u0438\u043c, \u0437\u0430\u0446\u0456\u043a\u0430\u0432\u043b\u0435\u043d\u0438\u043c \u0442\u0430 \u043c\u043e\u0442\u0438\u0432\u043e\u0432\u0430\u043d\u0438\u043c \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0430\u043c. \u0422\u043e\u043c\u0443 \u043d\u0435 \u0447\u0435\u043a\u0430\u0439\u0442\u0435, \u043f\u043e\u043a\u0438 \u0412\u0430\u043c \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u0435 \u0437\u0430\u043f\u0438\u0442\u0430\u043d\u043d\u044f \u043f\u043e \u043a\u043e\u0436\u043d\u043e\u043c\u0443 \u0430\u0441\u043f\u0435\u043a\u0442\u0443 \u0412\u0430\u0448\u043e\u0457 \u0440\u043e\u0431\u043e\u0442\u0438, \u043d\u0435 \u0437\u043c\u0443\u0448\u0443\u0439\u0442\u0435 \u0456\u043d\u0442\u0435\u0440\u0432'\u044e\u0435\u0440\u0430 \u0432\u0438\u0442\u044f\u0433\u0443\u0432\u0430\u0442\u0438 \u0437 \u0412\u0430\u0441 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e - \u0446\u0435 \u0437\u0430\u0432\u0436\u0434\u0438 \u0440\u043e\u0431\u0438\u0442\u044c \u043d\u0435\u0433\u0430\u0442\u0438\u0432\u043d\u0435 \u0432\u0440\u0430\u0436\u0435\u043d\u043d\u044f!","\u042f\u043a\u0449\u043e \u0412\u0438 \u0441\u0438\u043b\u044c\u043d\u043e \u0445\u0432\u0438\u043b\u044e\u0454\u0442\u0435\u0441\u044f, \u0441\u043a\u0430\u0436\u0456\u0442\u044c \u043f\u0440\u043e \u0446\u0435, \u0442\u0438\u043c \u0441\u0430\u043c\u0438\u043c \u0412\u0438 \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0435 \u043d\u0435\u0432\u0435\u043b\u0438\u043a\u0443 \u043f\u0430\u0443\u0437\u0443 \u0443 \u043f\u043e\u0442\u043e\u0446\u0456 \u043f\u0438\u0442\u0430\u043d\u044c, \u0441\u0438\u0442\u0443\u0430\u0446\u0456\u044f \u0442\u0440\u043e\u0445\u0438 \u0440\u043e\u0437\u0440\u044f\u0434\u0438\u0442\u044c\u0441\u044f, \u0430 \u0412\u0438 \u043e\u0442\u0440\u0438\u043c\u0430\u0454\u0442\u0435 \u043c\u043e\u0436\u043b\u0438\u0432\u0456\u0441\u0442\u044c \u0437\u0456\u0431\u0440\u0430\u0442\u0438\u0441\u044f \u0437 \u0434\u0443\u043c\u043a\u0430\u043c\u0438 \u0442\u0430 \u043f\u0440\u043e\u0434\u043e\u0432\u0436\u0438\u0442\u0438 \u0440\u043e\u0437\u043c\u043e\u0432\u0443.","\u0423\u0432\u0430\u0436\u043d\u043e \u0441\u043b\u0443\u0445\u0430\u0439\u0442\u0435 \u0437\u0430\u043f\u0438\u0442\u0430\u043d\u043d\u044f, \u044f\u043a\u0435 \u0412\u0430\u043c \u0437\u0430\u0434\u0430\u044e\u0442\u044c (\u043d\u0435\u0432\u0430\u0436\u043b\u0438\u0432\u043e \u043f\u0456\u0434 \u0447\u0430\u0441 \u043e\u0441\u043e\u0431\u0438\u0441\u0442\u043e\u0457 \u0437\u0443\u0441\u0442\u0440\u0456\u0447\u0456 \u0430\u0431\u043e \u043d\u0430 \u0435\u0442\u0430\u043f\u0456 \u0449\u0435 \u0442\u0435\u043b\u0435\u0444\u043e\u043d\u043d\u043e\u0457 \u0440\u043e\u0437\u043c\u043e\u0432\u0438). \u041d\u0435 \u043b\u043e\u0433\u0456\u0447\u043d\u0456\u0441\u0442\u044c, \u0445\u0430\u043e\u0442\u0438\u0447\u043d\u0456\u0441\u0442\u044c \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0435\u0439 \u0442\u0430 \u043d\u0435\u0443\u0432\u0430\u0436\u043d\u0456\u0441\u0442\u044c \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0435\u043d\u0442\u0430 \u043d\u0435\u0440\u0456\u0434\u043a\u043e \u0441\u0442\u0430\u044e\u0442\u044c \u043f\u0440\u0438\u0447\u0438\u043d\u0430\u043c\u0438 \u0442\u043e\u0433\u043e, \u0449\u043e \u0412\u0430\u0441 \u043f\u0456\u0441\u043b\u044f \u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u0445\u0432\u0438\u043b\u0438\u043d \u0441\u043f\u0456\u043b\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0442\u0435\u043b\u0435\u0444\u043e\u043d\u043e\u043c \u0432\u0436\u0435 \u043d\u0435 \u0433\u043e\u0442\u043e\u0432\u0456 \u0440\u043e\u0437\u0433\u043b\u044f\u0434\u0430\u0442\u0438 \u043d\u0430 \u0442\u0443 \u0447\u0438 \u0456\u043d\u0448\u0443 \u043f\u043e\u0441\u0430\u0434\u0443. \u042f\u043a\u0449\u043e \u0412\u0438 \u043d\u0435\u0434\u043e\u0447\u0443\u043b\u0438 - \u043f\u0435\u0440\u0435\u043f\u0438\u0442\u0430\u0439\u0442\u0435, \u043d\u0435\u0437\u0440\u043e\u0437\u0443\u043c\u0456\u043b\u0430 \u0441\u0443\u0442\u044c \u043f\u0438\u0442\u0430\u043d\u043d\u044f - \u043f\u0435\u0440\u0435\u0444\u043e\u0440\u043c\u0443\u043b\u044e\u0439\u0442\u0435 \u0442\u0430 \u0443\u0442\u043e\u0447\u043d\u0456\u0442\u044c, \u0447\u0438 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u043e \u0412\u0438 \u0437\u0440\u043e\u0437\u0443\u043c\u0456\u043b\u0438 \u0442\u0435, \u0449\u043e \u0445\u043e\u0447\u0443\u0442\u044c \u0432\u0456\u0434 \u0412\u0430\u0441 \u043f\u043e\u0447\u0443\u0442\u0438.","\u0423 \u0431\u0435\u0441\u0456\u0434\u0456 \u0431\u0443\u0434\u044c\u0442\u0435 \u0443\u0432\u0430\u0436\u043d\u0456 \u0442\u0430 \u0434\u043e\u0431\u0440\u043e\u0437\u0438\u0447\u043b\u0438\u0432\u0456, \u0430 \u043f\u0440\u0438 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u044f\u0445 - \u043b\u043e\u0433\u0456\u0447\u043d\u0456, \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u0456 \u0442\u0430 \u0437\u0440\u043e\u0437\u0443\u043c\u0456\u043b\u0456."],t.i)
$.b82=A.a(["\u0425\u0442\u043e\u0441\u044c \u0439\u0434\u0435 \u043d\u0430 \u0441\u043f\u0456\u0432\u0431\u0435\u0441\u0456\u0434\u0443 \u043b\u0435\u0433\u043a\u043e, \u043a\u0435\u0440\u0443\u044e\u0447\u0438\u0441\u044c \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u043e\u043c \xab\u044f\u043a \u0431\u0443\u0434\u0435, \u0442\u0430\u043a \u0456 \u0431\u0443\u0434\u0435\xbb. \u0411\u0430\u0433\u0430\u0442\u043e \u0445\u0442\u043e \u0441\u043f\u0440\u0438\u0439\u043c\u0430\u0454 \u0456\u043d\u0442\u0435\u0440\u0432'\u044e \u0437 \u0440\u0435\u043a\u0440\u0443\u0442\u0435\u0440\u043e\u043c \u044f\u043a \u043e\u0434\u0438\u043d \u0437 \u043d\u0430\u0439\u0432\u0430\u0436\u043b\u0438\u0432\u0456\u0448\u0438\u0445 \u0456\u0441\u043f\u0438\u0442\u0456\u0432, \u0432\u0456\u0434 \u044f\u043a\u043e\u0433\u043e \u0437\u0430\u043b\u0435\u0436\u0438\u0442\u044c \u0432\u0441\u0435 \u043c\u0430\u0439\u0431\u0443\u0442\u043d\u0454 \u0436\u0438\u0442\u0442\u044f. \u042f\u043a \u0431\u0438 \u0442\u0430\u043c \u043d\u0435 \u0431\u0443\u043b\u043e, \u044f\u043a\u0449\u043e \u0432\u0438 \u0437\u0456\u0431\u0440\u0430\u043b\u0438\u0441\u044f \u043d\u0430 \u0441\u043f\u0456\u0432\u0431\u0435\u0441\u0456\u0434\u0443, \u0437\u043d\u0430\u0447\u0438\u0442\u044c, \u0439\u043e\u0433\u043e \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442 \u0432\u0430\u043c \u043d\u0435 \u0431\u0430\u0439\u0434\u0443\u0436\u0438\u0439.","\u0410 \u0442\u043e\u043c\u0443 \u043d\u0435\u043f\u043e\u0433\u0430\u043d\u043e \u0431\u0443\u043b\u043e \u0431 \u043f\u0456\u0434\u0433\u043e\u0442\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u0434\u043e \u043c\u0430\u0439\u0431\u0443\u0442\u043d\u044c\u043e\u0433\u043e \u0456\u043d\u0442\u0435\u0440\u0432'\u044e. \u041f\u0435\u0440\u0448 \u043d\u0456\u0436 \u0432\u0438\u0440\u0443\u0448\u0438\u0442\u0438 \u043d\u0430 \u0441\u043f\u0456\u0432\u0431\u0435\u0441\u0456\u0434\u0443 \u0434\u043e \u0440\u0435\u043a\u0440\u0443\u0442\u0438\u043d\u0433\u043e\u0432\u043e\u0457 \u0430\u0433\u0435\u043d\u0446\u0456\u0457, \u0434\u0456\u0437\u043d\u0430\u0439\u0442\u0435\u0441\u044f, \u044f\u043a\u0456 \u043f\u0438\u0442\u0430\u043d\u043d\u044f \u043d\u0430\u0439\u0447\u0430\u0441\u0442\u0456\u0448\u0435 \u0441\u0442\u0430\u0432\u043b\u044f\u0442\u044c \u0440\u0435\u043a\u0440\u0443\u0442\u0435\u0440\u0438.","1. \u0427\u0438 \u043d\u0435 \u043c\u043e\u0433\u043b\u0438 \u0431 \u0432\u0438 \u0440\u043e\u0437\u043f\u043e\u0432\u0456\u0441\u0442\u0438 \u043f\u0440\u043e \u0441\u0435\u0431\u0435?",'\u0413\u043e\u043b\u043e\u0432\u043d\u0435 \u043f\u0440\u0438 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0456 \u2014 \u0432\u0438\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0431\u0430\u043b\u0430\u043d\u0441 \u0434\u0456\u043b\u043e\u0432\u043e\u0457 \u0442\u0430 \u043e\u0441\u043e\u0431\u0438\u0441\u0442\u043e\u0457 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457. \u041d\u0430\u0433\u043e\u043b\u043e\u0441 \u0432\u0430\u0440\u0442\u043e \u0437\u0440\u043e\u0431\u0438\u0442\u0438 \u043d\u0430 \u0441\u0432\u0456\u0439 \u0434\u043e\u0441\u0432\u0456\u0434 \u0440\u043e\u0431\u043e\u0442\u0438, \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u0430 \u043e\u0441\u0432\u0456\u0442\u0430, \u043c\u0438\u043c\u043e\u0445\u0456\u0442\u044c \u0437\u0433\u0430\u0434\u0430\u0442\u0438 \u043f\u0440\u043e \u0434\u043e\u0441\u044f\u0433\u043d\u0435\u043d\u043d\u044f (\u043f\u043e\u0431\u0456\u0436\u043d\u043e - \u0442\u043e\u043c\u0443 \u0449\u043e \u0432\u0430\u043c \u0449\u0435 \u0434\u0430\u0434\u0443\u0442\u044c \u0432\u0438\u0433\u043e\u0432\u043e\u0440\u0438\u0442\u0438\u0441\u044f \u043d\u0430 \u0446\u044e \u0442\u0435\u043c\u0443). \u041c\u043e\u0436\u043d\u0430 \u0432\u0456\u0434\u043c\u043e\u0432\u0438\u0442\u0438\u0441\u044f \u0440\u043e\u0437\u043a\u0440\u0438\u0432\u0430\u0442\u0438\u0441\u044f \u043d\u0435 \u0437 \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u0439\u043d\u043e\u0433\u043e \u0431\u043e\u043a\u0443, \u0430\u043b\u0435 \u044f\u043a\u0449\u043e \u0432\u0438 \u0442\u0440\u043e\u0445\u0438 \u0440\u043e\u0437\u043f\u043e\u0432\u0456\u0441\u0442\u0435 \u043f\u0440\u043e \u0441\u0432\u043e\u0457 \u0437\u0430\u0445\u043e\u043f\u043b\u0435\u043d\u043d\u044f, \u0446\u0435 \u0431\u0443\u0434\u0435 \u043f\u043b\u044e\u0441. \u041e\u0441\u043e\u0431\u043b\u0438\u0432\u043e, \u044f\u043a\u0449\u043e \u0445\u043e\u0431\u0456 \u0441\u043f\u0440\u0438\u044f\u044e\u0442\u044c \u0441\u0430\u043c\u043e\u0440\u043e\u0437\u0432\u0438\u0442\u043a\u0443. \u041d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, \u0432\u0438 \u043b\u044e\u0431\u0438\u0442\u0435 \u0445\u043e\u043a\u0435\u0439 \u0456 \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u043e \u0440\u043e\u0431\u0438\u0442\u0435 \u043f\u0435\u0440\u0435\u043a\u043b\u0430\u0434\u0438 \u0437\u0430\u043e\u043a\u0435\u0430\u043d\u0441\u044c\u043a\u043e\u0457 \u043f\u0440\u0435\u0441\u0438 \u0432 \u0441\u0432\u0456\u0439 \u043e\u0441\u043e\u0431\u0438\u0441\u0442\u0438\u0439 \u0431\u043b\u043e\u0433 \u043f\u0440\u043e "\u0411\u043e\u0441\u0442\u043e\u043d \u0411\u0440\u044e\u0457\u043d\u0437" - \u0446\u0435 \u043b\u0435\u0433\u043a\u043e \u043f\u043e\u0434\u0430\u0442\u0438 \u043f\u0456\u0434 \u0441\u043e\u0443\u0441\u043e\u043c "\u0432\u0434\u043e\u0441\u043a\u043e\u043d\u0430\u043b\u0435\u043d\u043d\u044f \u0430\u043d\u0433\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0457". \u0427\u0438\u0442\u0430\u0454\u0442\u0435 \u0441\u0443\u0447\u0430\u0441\u043d\u0443 \u043b\u0456\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u0443? \u0412\u0456\u0434\u043c\u0456\u043d\u043d\u043e, \u0441\u0442\u0435\u0436\u0438\u0442\u0438 \u0437\u0430 \u0442\u0440\u0435\u043d\u0434\u0430\u043c\u0438 \u0432 \u0440\u0456\u0437\u043d\u0438\u0445 \u0441\u0444\u0435\u0440\u0430\u0445 \u0436\u0438\u0442\u0442\u044f - \u043a\u043e\u0440\u0438\u0441\u043d\u0430 \u044f\u043a\u0456\u0441\u0442\u044c \u0431\u0443\u0434\u044c-\u044f\u043a\u043e\u0433\u043e \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0430.',"2. \u042f\u043a\u0456 \u0443 \u0432\u0430\u0441 \u0454 \u043d\u0435\u0434\u043e\u043b\u0456\u043a\u0438 \u0442\u0430 \u0441\u043b\u0430\u0431\u043a\u0456 \u0441\u0442\u043e\u0440\u043e\u043d\u0438?","\u0422\u043e\u0439 \u0432\u0438\u043f\u0430\u0434\u043e\u043a, \u043a\u043e\u043b\u0438 \u0447\u0435\u0441\u043d\u0430 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u044c \u0437\u043c\u0435\u043d\u0448\u0438\u0442\u044c \u0432\u0430\u043c \u0431\u0430\u043b\u0456\u0432. \u0406\u043d\u0448\u0456 \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0435\u043d\u0442\u0438 \u043d\u0430 \u0432\u0430\u043a\u0430\u043d\u0441\u0456\u044e \u0442\u0435\u0436 \u043c\u0430\u044e\u0442\u044c \u043d\u0435\u0434\u043e\u043b\u0456\u043a\u0438, \u0406 \u044f\u043a\u0449\u043e \u0432\u043e\u043d\u0438 \u043f\u0440\u043e \u0441\u0432\u043e\u0457\u0445 \u043d\u0435 \u0440\u043e\u0437\u043a\u0430\u0436\u0443\u0442\u044c, \u0430 \u0432\u0438 \u0432\u0438\u044f\u0432\u0438\u0442\u0435 \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u043e\u0432\u0456\u0441\u0442\u044c, \u0442\u043e \u043d\u0456\u0447\u043e\u0433\u043e \u0434\u043e\u0431\u0440\u043e\u0433\u043e \u043d\u0435 \u0431\u0443\u0434\u0435. \xab\u041a\u0430\u043d\u0434\u0438\u0434\u0430\u0442 \u0440\u043e\u0437\u043f\u043e\u0432\u0456\u0432, \u0429\u043e \u0442\u0440\u043e\u0445\u0438 \u043d\u0435\u043f\u0443\u043d\u043a\u0442\u0443\u0430\u043b\u044c\u043d\u0438\u0439. \u0417 \u043e\u0433\u043b\u044f\u0434\u0443 \u043d\u0430 \u0439\u043e\u0433\u043e \u043a\u0432\u0430\u043b\u0456\u0444\u0456\u043a\u0430\u0446\u0456\u044e \u2014 \u043c\u043e\u0436\u043d\u0430 \u043f\u0440\u043e\u0431\u0430\u0447\u0438\u0442\u0438. \u0410\u043b\u0435, \u043c\u043e\u0436\u043b\u0438\u0432\u043e, \u0437\u0430\u0432\u0434\u0430\u043d\u043d\u044f \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0456 - \u0432\u0456\u0434\u0432\u0435\u0440\u043d\u0443\u0442\u0438 \u0443\u0432\u0430\u0433\u0443 \u0432\u0456\u0434 \u0456\u043d\u0448\u0438\u0445, \u041a\u0443\u0434\u0438 \u0441\u0435\u0440\u0439\u043e\u0437\u043d\u0456\u0448\u0456 \u043d\u0435\u0434\u043e\u043b\u0456\u043a\u0438? \u041d\u0435 \u043f\u0440\u043e\u0441\u0442\u043e \u0442\u0430\u043a \u0432\u0456\u043d \u043b\u0435\u0433\u043a\u043e \u0437\u0456\u0437\u043d\u0430\u0432\u0441\u044f \u0432 \u0442\u043e\u043c\u0443, \u0449\u043e \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u043e \u0441\u043f\u0456\u0437\u043d\u044e\u0454\u0442\u044c\u0441\u044f\xbb, - \u043d\u0430 \u0436\u0430\u043b\u044c, \u0431\u0430\u0433\u0430\u0442\u043e \u0440\u0435\u043a\u0440\u0443\u0442\u0435\u0440\u0456\u0432 \u043f\u043e\u0434\u0443\u043c\u0430\u044e\u0442\u044c \u0441\u0430\u043c\u0435 \u0442\u0430\u043a.","\u0422\u043e\u043c\u0443 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u0439\u0442\u0435 \u0432 \u0441\u0442\u0438\u043b\u0456 \xab\u0423 \u043c\u043e\u0457\u0445 \u043d\u0435\u0434\u043e\u043b\u0456\u043a\u0456\u0432 \u0454 \u0441\u0435\u0440\u0439\u043e\u0437\u043d\u0430 \u0433\u0456\u0434\u043d\u0456\u0441\u0442\u044c: \u0432\u043e\u043d\u0438 \u043d\u0456\u044f\u043a \u043d\u0435 \u043f\u043e\u0437\u043d\u0430\u0447\u0430\u044e\u0442\u044c\u0441\u044f \u043d\u0430 \u0440\u043e\u0431\u043e\u0447\u0456\u0439 \u0434\u0456\u044f\u043b\u044c\u043d\u043e\u0441\u0442\u0456\xbb.",'\u041d\u0430\u0448\u0430 \u043f\u043e\u0440\u0430\u0434\u0430 \u0437\u0456\u0437\u043d\u0430\u0439\u0442\u0435\u0441\u044f \u0432 \u043d\u0435\u0434\u043e\u043b\u0456\u043a\u0443, \u044f\u043a\u0438\u0439 \u043d\u0435 \u0434\u0443\u0436\u0435 \u0437\u043d\u0430\u0447\u043d\u0438\u0439 \u0434\u043b\u044f \u043f\u043e\u0441\u0430\u0434\u0438, \u043d\u0430 \u044f\u043a\u0443 \u0412\u0438 \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0443\u0454\u0442\u0435. \u042f\u043a\u0449\u043e \u0431\u0443\u0445\u0433\u0430\u043b\u0442\u0435\u0440 \u0441\u043a\u0430\u0436\u0435, \u0449\u043e \u0432\u0456\u043d \u043d\u0430 \u0440\u043e\u0431\u043e\u0442\u0456 \u043d\u0435 \u043c\u043e\u0436\u0435 \u0441\u0435\u0431\u0435 \u043d\u0430\u0437\u0432\u0430\u0442\u0438 "\u0434\u0443\u0448\u043e\u044e \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457" \u0456 \u043d\u0435 \u0434\u0443\u0436\u0435 \u0431\u0430\u0433\u0430\u0442\u043e\u0441\u043b\u043e\u0432\u043d\u0438\u0439 \u0439\u043e\u043c\u0443 \u043b\u0435\u0433\u043a\u043e \u0446\u0435 \u043f\u0440\u043e\u0431\u0430\u0447\u0430\u0442\u044c.',"3. \u042f\u043a\u0456 \u0443 \u0432\u0430\u0441 \u0431\u0443\u043b\u0438 \u0434\u043e\u0441\u044f\u0433\u043d\u0435\u043d\u043d\u044f \u043d\u0430 \u043c\u0438\u043d\u0443\u043b\u043e\u043c\u0443 \u043c\u0456\u0441\u0446\u0456 \u0440\u043e\u0431\u043e\u0442\u0438?","\u041d\u0435\u043f\u043e\u0433\u0430\u043d\u043e, \u044f\u043a\u0449\u043e \u0441\u0435\u0440\u0439\u043e\u0437\u043d\u0456 \u0434\u043e\u0441\u044f\u0433\u043d\u0435\u043d\u043d\u044f \u0443 \u0432\u0430\u0441 \u0441\u043f\u0440\u0430\u0432\u0434\u0456 \u0431\u0443\u043b\u0438. \u0410\u043b\u0435 \u043d\u0430\u0432\u0456\u0442\u044c \u0434\u0443\u0436\u0435 \u043a\u0440\u0443\u0442\u0456 \u0444\u0430\u0445\u0456\u0432\u0446\u0456 \u043d\u0435 \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u043f\u0443\u0441\u043a\u0430\u0442\u0438\u0441\u044f \u0432 \u0440\u043e\u0437\u043b\u043e\u0433\u0443 \u0440\u043e\u0437\u043f\u043e\u0432\u0456\u0434\u044c, \u0441\u0445\u043e\u0436\u0443 \u043d\u0430 \u043f\u0435\u0440\u0435\u043a\u0430\u0437 \u043c\u0456\u0444\u0456\u0432 \u043f\u0440\u043e \u0413\u0435\u0440\u0430\u043a\u043b\u0430. \u0412\u0438\u0434\u0456\u043b\u0456\u0442\u044c \u043e\u0441\u043d\u043e\u0432\u043d\u0435 - \u0441\u043a\u0440\u043e\u043c\u043d\u0456, \u0430\u043b\u0435 \u0437\u043d\u0430\u044e\u0447\u0456 \u0441\u043e\u0431\u0456 \u0446\u0456\u043d\u0443 \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0438 \u043a\u043e\u0442\u0438\u0440\u0443\u044e\u0442\u044c\u0441\u044f \u0432\u0438\u0441\u043e\u043a\u043e.","\u0420\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u0456 \u043b\u044e\u0431\u043b\u044f\u0442\u044c \u0434\u043e\u0441\u044f\u0433\u043d\u0435\u043d\u043d\u044f \u0432 \u0446\u0438\u0444\u0440\u0430\u0445, \u0442\u043e\u043c\u0443 \u043c\u043e\u0436\u0435\u0442\u0435 \u0441\u043a\u0430\u0437\u0430\u0442\u0438 \u0449\u043e \u043d\u0430 \u043e\u0441\u0442\u0430\u043d\u043d\u044c\u043e\u043c\u0443 \u043c\u0456\u0441\u0446\u0456 \u0440\u043e\u0431\u043e\u0442\u0438 3 \u0440\u0430\u0437\u0438 \u043f\u0435\u0440\u0435\u0432\u0438\u043a\u043e\u043d\u0443\u0432\u0430\u043b\u0438 \u043f\u043b\u0430\u043d \u043d\u0430 20% \u0456 \u0446\u0435 \u0431\u0443\u0434\u0435 \u0434\u0443\u0436\u0435 \u0437\u043d\u0430\u0447\u0443\u0449\u0435.","\u041e\u0441\u043e\u0431\u043b\u0438\u0432\u0438\u0445 \u0434\u043e\u0441\u044f\u0433\u043d\u0435\u043d\u044c \u043d\u0435\u043c\u0430\u0454? \u041d\u0435 \u0431\u0456\u0434\u0430, \u043f\u043e\u043a\u043e\u043f\u0430\u0439\u0442\u0435\u0441\u044f \u0432 \u043f\u0430\u043c'\u044f\u0442\u0456: \u0432\u0430\u0440\u0456\u0430\u043d\u0442\u0438 \xab\u043f\u043e\u043b\u0456\u043f\u0448\u0438\u043b\u0438 \u0441\u0432\u043e\u0457 \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u0439\u043d\u0456 \u043d\u0430\u0432\u0438\u0447\u043a\u0438\xbb, \xab\u043e\u0441\u0432\u043e\u0457\u0432 \u043a\u043e\u0440\u0438\u0441\u043d\u0443 \u0432 \u0440\u043e\u0431\u043e\u0442\u0456 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0443\xbb - \u043a\u0440\u0430\u0449\u0435, \u043d\u0456\u0436 \u043d\u0456\u0447\u043e\u0433\u043e.","4. \u0427\u043e\u043c\u0443 \u0432\u0438 \u0440\u043e\u0437\u043b\u0443\u0447\u0438\u043b\u0438\u0441\u044f \u0437 \u043c\u0438\u043d\u0443\u043b\u0438\u043c \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u0435\u043c?","\u041d\u0435\u043f\u0440\u0438\u043f\u0443\u0441\u0442\u0438\u043c\u043e \u043d\u0430\u0440\u0456\u043a\u0430\u0442\u0438 \u043d\u0430 \u043f\u043e\u0433\u0430\u043d\u0456 \u0441\u0442\u043e\u0441\u0443\u043d\u043a\u0438 \u0437 \u043a\u043e\u043b\u0435\u0433\u0430\u043c\u0438 \u0442\u0430 \u043d\u0430\u0447\u0430\u043b\u044c\u0441\u0442\u0432\u043e\u043c \u2014 \u0432\u0430\u0441 \u043d\u0430\u043f\u0435\u0432\u043d\u043e \u043f\u0440\u0438\u0439\u043c\u0443\u0442\u044c \u0437\u0430 \u043a\u043e\u043d\u0444\u043b\u0456\u043a\u0442\u043d\u0443 \u043b\u044e\u0434\u0438\u043d\u0443. \u041d\u0456\u0449\u043e \u043f\u0435\u0440\u0441\u043f\u0435\u043a\u0442\u0438\u0432\u0438 \u043a\u0430\u0440'\u0454\u0440\u043d\u043e\u0433\u043e \u0437\u0440\u043e\u0441\u0442\u0430\u043d\u043d\u044f - \u043f\u043e\u0432\u0430\u0436\u043d\u0430 \u043f\u0440\u0438\u0447\u0438\u043d\u0430, \u0430\u043b\u0435 \u0442\u0456\u043b\u044c\u043a\u0438 \u0432 \u0442\u043e\u043c\u0443 \u0432\u0438\u043f\u0430\u0434\u043a\u0443, \u044f\u043a\u0449\u043e \u043d\u0430 \u043d\u043e\u0432\u043e\u043c\u0443 \u043c\u0456\u0441\u0446\u0456\u0426\u0456 \u043f\u0435\u0440\u0441\u043f\u0435\u043a\u0442\u0438\u0432\u0438 \u043f\u043e\u043a\u0440\u0430\u0449\u0430\u0442\u044c\u0441\u044f. \u041f\u043e\u0432\u0430\u0436\u043d\u043e\u044e \u043f\u0440\u0438\u0447\u0438\u043d\u043e\u044e \u0437\u0432\u0456\u043b\u044c\u043d\u0435\u043d\u043d\u044f \u0454 \u043f\u0435\u0440\u0435\u0457\u0437\u0434 \u043e\u0444\u0456\u0441\u0443 \u0432 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457 \u0434\u043e \u0456\u043d\u0448\u043e\u0433\u043e \u0440\u0430\u0439\u043e\u043d\u0443.\u043c\u0456\u0441\u0442\u0430 \u0430\u0431\u043e \u0431\u0430\u0433\u0430\u0442\u043e\u043c\u0456\u0441\u044f\u0447\u043d\u0456 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0438 \u0437\u0430\u0440\u043e\u0431\u0456\u0442\u043d\u043e\u0457 \u043f\u043b\u0430\u0442\u0438. \u0412 \u0456\u043d\u0448\u043e\u043c\u0443 \u043a\u0440\u0430\u0449\u0435 \u0433\u043e\u0432\u043e\u0440\u0438\u0442\u0438 \u043f\u0440\u0430\u0432\u0434\u0443. \u0413\u0440\u043e\u0448\u043e\u0432\u0438\u0439 \u043f\u0438\u0442\u0430\u043d\u043d\u044f \u0437\u0433\u0430\u0434\u0430\u0442\u0438 \u0432\u0430\u0440\u0442\u043e, \u0430\u043b\u0435 \u0431\u0430\u0436\u0430\u043d\u043e \u043d\u0430\u043f\u0440\u0438\u043a\u0456\u043d\u0446\u0456 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0456.","5. \u042f\u043a\u0430 \u0437\u0430\u0440\u043f\u043b\u0430\u0442\u0430 \u0432\u0430\u0441 \u0432\u043b\u0430\u0448\u0442\u0443\u0454?","\u041f\u0435\u0440\u0435\u0445\u043e\u0434\u0438\u0442\u0438 \u043d\u0430 \u043d\u043e\u0432\u0435 \u043c\u0456\u0441\u0446\u0435 \u0437\u0456 \u0437\u043d\u0438\u0436\u0435\u043d\u043d\u044f\u043c \u043e\u043a\u043b\u0430\u0434\u0443 - \u043d\u043e\u043d\u0441\u0435\u043d\u0441. \u0422\u043e\u043c\u0443 \u043d\u0430\u0432\u0456\u0442\u044c \u044f\u043a\u0449\u043e \u0437\u043c\u0456\u043d\u0430 \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u044f \u043d\u0456\u044f\u043a\u043d\u0435 \u043f\u043e\u0432'\u044f\u0437\u0430\u043d\u0430 \u0437 \u0432\u0430\u0448\u0438\u043c\u0438 \u0433\u0440\u043e\u0448\u043e\u0432\u0438\u043c\u0438 \u0437\u0430\u043f\u0438\u0442\u0430\u043c\u0438, \u0432\u0430\u0440\u0442\u043e \u043d\u0430\u0437\u0432\u0430\u0442\u0438 \u0446\u0438\u0444\u0440\u0443 \u0432\u0438\u0449\u043e\u044e, \u043d\u0456\u0436 \u0432\u0430\u0448\u0430 \u043f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u044f \u0437\u0430\u0440\u043f\u043b\u0430\u0442\u0430. \u0412 \u0456\u0434\u0435\u0430\u043b\u0456 - \u043d\u0430 \u0434\u0435\u0441\u044f\u0442\u044c-\u043f'\u044f\u0442\u043d\u0430\u0434\u0446\u044f\u0442\u044c \u0432\u0456\u0434\u0441\u043e\u0442\u043a\u0456\u0432.","6. \u042f\u043a \u0432\u0438 \u0431\u0430\u0447\u0438\u0442\u0435 \u0441\u0432\u043e\u0454 \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u0439\u043d\u0435 \u043c\u0430\u0439\u0431\u0443\u0442\u043d\u0454 \u0447\u0435\u0440\u0435\u0437 \u043f'\u044f\u0442\u044c \u0440\u043e\u043a\u0456\u0432?","\u0414\u0443\u0436\u0435 \u043d\u0435\u043f\u0440\u0438\u0454\u043c\u043d\u0435 \u043f\u0438\u0442\u0430\u043d\u043d\u044f \u0434\u043b\u044f \u0442\u0438\u0445, \u0445\u0442\u043e \u043f\u043b\u0430\u043d\u0443\u0454 \u043d\u0430\u0439\u0431\u043b\u0438\u0436\u0447\u0438\u043c\u0438 \u0440\u043e\u043a\u0430\u043c\u0438 \u0437\u043c\u0456\u043d\u0438\u0442\u0438 \u0441\u0444\u0435\u0440\u0443 \u0434\u0456\u044f\u043b\u044c\u043d\u043e\u0441\u0442\u0456 \u0422\u0438, \u043c\u0430\u044e\u0447\u0438 \u0441\u0435\u0440\u0439\u043e\u0437\u043d\u0456 \u0430\u043c\u0431\u0456\u0446\u0456\u0457, \u0440\u043e\u0437\u0440\u0430\u0445\u043e\u0432\u0443\u0454 \u043d\u0430 \u0431\u043b\u0438\u0441\u043a\u0430\u0432\u0438\u0447\u043d\u0435 \u043f\u0456\u0434\u0432\u0438\u0449\u0435\u043d\u043d\u044f \u043d\u0430 \u043f\u043e\u0441\u0430\u0434\u0456. \u042f\u043a\u0449\u043e \u044f\u043a\u0438\u0445\u043e\u0441\u044c \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u0438\u0445 \u0434\u0443\u043c\u043e\u043a \u043f\u0440\u043e \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u0439\u043d\u0435 \u043c\u0430\u0439\u0431\u0443\u0442\u043d\u0454 \u043d\u0435\u043c\u0430\u0454, \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u0442\u0438 \u0442\u0430\u043a\u043e\u0436 \u0441\u043a\u043b\u0430\u0434\u043d\u043e.","\u0421\u043b\u0456\u0434 \u0432\u0438\u0445\u043e\u0434\u0438\u0442\u0438 \u0437 \u0442\u043e\u0433\u043e, \u0449\u043e \u043a\u0430\u0434\u0440\u043e\u0432\u0438\u043a \u0445\u043e\u0447\u0435 \u043f\u043e\u0447\u0443\u0442\u0438. \u0410 \u0432\u0456\u043d, \u043d\u0430\u043f\u0435\u0432\u043d\u043e, \u0431\u0443\u0434\u0435 \u0437\u0430\u0434\u043e\u0432\u043e\u043b\u0435\u043d\u0438\u0439 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0434\u044e, \u0449\u043e \u0432\u0438 \u043f\u043b\u0430\u043d\u0443\u0454\u0442\u0435 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438 \u0432 \u0442\u0456\u0439 \u0436\u0435 \u0441\u0444\u0435\u0440\u0456, \u0445\u043e\u0447\u0430 \u043d\u0435 \u0432\u0456\u0434\u043c\u043e\u0432\u0438\u0442\u0435\u0441\u044f \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u0442\u0438 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457 \u043d\u0430 \u0432\u0438\u0449\u043e\u043c\u0443 \u043a\u0430\u0440'\u0454\u0440\u043d\u043e\u043c\u0443 \u0449\u0430\u0431\u043b\u0456.","7. \u0429\u043e \u0432\u0438 \u0447\u0443\u043b\u0438 \u043f\u0440\u043e \u043d\u0430\u0448\u0443 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u044e?",'\u0422\u0443\u0442 \u0432\u0441\u0435 \u043f\u0440\u043e\u0441\u0442\u043e. \u041f\u043e\u0447\u0438\u0442\u0430\u0439\u0442\u0435 \u043f\u0440\u043e \u043d\u043e\u0432\u043e\u0433\u043e \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u044f, \u0437\u0430\u0432\u0456\u0442\u0430\u0439\u0442\u0435 \u043d\u0430 \u0439\u043e\u0433\u043e \u0441\u0430\u0439\u0442. \u0412\u0430\u0440\u0456\u0430\u043d\u0442 \xab\u041f\u0440\u0430\u043a\u0442\u0438\u0447\u043d\u043e \u043d\u0456\u0447\u043e\u0433\u043e \u043d\u0435 \u0447\u0443\u0432 \u0456 \u043d\u0435 \u0437\u043d\u0430\u044e, \u041c\u0435\u043d\u0456 \u043f\u0440\u043e\u0441\u0442\u043e \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u0430 \u0432\u0435\u043b\u0438\u043a\u0430 \u0437\u0430\u0440\u043f\u043b\u0430\u0442\u0430" - \u043f\u0440\u043e\u0432\u0430\u043b\u044c\u043d\u0438\u0439.8. \u0427\u043e\u043c\u0443 \u0432\u0438 \u0432\u0438\u0440\u0456\u0448\u0438\u043b\u0438 \u043f\u0440\u0430\u0446\u0435\u0432\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438\u0441\u044c \u0443 \u043d\u0430\u0448\u0443 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u044e?',"\u041f\u043e\u0433\u043e\u0432\u043e\u0440\u0456\u0442\u044c \u0442\u0440\u043e\u0445\u0438 \u043f\u0440\u043e \u0457\u0445\u043d\u0456 \u043f\u043b\u044e\u0441\u0438. \xab\u0421\u0442\u0430\u0442\u0438 \u0432\u0430\u0436\u043b\u0438\u0432\u0438\u043c \u0435\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u043c \u0443 \u0432\u0430\u0448\u0456\u0439 \u0441\u0438\u0441\u0442\u0435\u043c\u0456, \u0441\u0438\u0441\u0442\u0435\u043c\u0456 \u043b\u0456\u0434\u0435\u0440\u0430 \u0433\u0430\u043b\u0443\u0437\u0456 \u2014 \u043c\u0456\u0439 \u043f\u0440\u0456\u043e\u0440\u0438\u0442\u0435\u0442\xbb"," \xab\u0432\u0438 \u043f\u043e\u0434\u0430\u0440\u0443\u0454\u0442\u0435 \u043c\u0435\u043d\u0456 \u0441\u0442\u0430\u0431\u0456\u043b\u044c\u043d\u0456\u0441\u0442\u044c - \u0442\u0435, \u0449\u043e \u044f \u0434\u043e\u043b\u0433\u043e \u0447\u0435\u043a\u0430\u0432\xbb. \u0412\u0456\u0434\u043c\u0456\u043d\u043d\u043e \u0431\u0443\u0434\u0435 \u0434\u043e\u043f\u043e\u0432\u043d\u0438\u0442\u0438 \u043e\u0441\u043d\u043e\u0432\u043d\u0435 \u043e\u043f\u043e\u0432\u0456\u0434\u0430\u043d\u043d\u044f \u043f\u043e\u0431\u0443\u0442\u043e\u0432\u0438\u043c\u0438 \u0434\u0440\u0456\u0431\u043d\u0438\u0446\u044f\u043c\u0438: \xab\u0414\u0430\u0432\u043d\u043e \u0445\u043e\u0447\u0443 \u0437\u043d\u044f\u0442\u0438 \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u0443 \u0432 \u0441\u0443\u0441\u0456\u0434\u043d\u044c\u043e\u043c\u0443 \u043a\u0432\u0430\u0440\u0442\u0430\u043b\u0456: \u0442\u0430\u043c \u0445\u043e\u0440\u043e\u0448\u0430 \u0456\u043d\u0444\u0440\u0430\u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0430\xbb.","\u0413\u0440\u043e\u0448\u0456, \u044f\u043a \u0431\u0438 \u0432\u043e\u043d\u0438 \u043d\u0435 \u0431\u0443\u043b\u0438 \u0432\u0430\u0436\u043b\u0438\u0432\u0438\u043c\u0438, \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u0437'\u044f\u0432\u043b\u044f\u0442\u0438\u0441\u044f \u0432 \u0437\u0430\u0432\u0435\u0440\u0448\u0430\u043b\u044c\u043d\u0456\u0439 \u0447\u0430\u0441\u0442\u0438\u043d\u0456 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0456: \xab\u041a\u0440\u0456\u043c \u0442\u043e\u0433\u043e, \u043d\u0435\u0432\u0435\u043b\u0438\u043a\u0435 \u043f\u0456\u0434\u0432\u0438\u0449\u0435\u043d\u043d\u044f \u0437\u0430\u0440\u043f\u043b\u0430\u0442\u0438 \u043c\u0435\u043d\u0456 \u043d\u0435 \u0437\u0430\u0448\u043a\u043e\u0434\u0438\u0442\u044c\xbb.","9. \u0427\u0438 \u043d\u0430\u0434\u043e\u0432\u0433\u043e \u0432\u0438 \u043f\u0440\u0438\u0439\u0448\u043b\u0438 \u0434\u043e \u043d\u0430\u0441?","\u0412\u0438\u0441\u043e\u043a\u0430 \u0441\u043f\u043e\u043a\u0443\u0441\u0430 \u0441\u043a\u0430\u0437\u0430\u0442\u0438, \u0449\u043e \u043f\u043b\u0430\u043d\u0443\u0454\u0442\u0435 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438 \u0432 \u0442\u0430\u043a\u0456\u0439 \u0447\u0443\u0434\u043e\u0432\u0456\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457 \u044f\u043a \u043c\u0456\u043d\u0456\u043c\u0443\u043c \u043d\u0430\u0439\u0431\u043b\u0438\u0436\u0447\u0456 \u0441\u0456\u043c \u0440\u043e\u043a\u0456\u0432, \u0410\u043b\u0435 \u043d\u0435 \u043f\u043e\u0441\u043f\u0456\u0448\u0430\u0439\u0442\u0435. \u0422\u0430\u043a\u0430 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u044c \u0432\u0438\u0433\u043b\u044f\u0434\u0430\u0454 \u043d\u0435\u0449\u0438\u0440\u043e\u044e \u0456 \u043c\u043e\u0436\u0435 \u0437\u0456\u043f\u0441\u0443\u0432\u0430\u0442\u0438 \u0432\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u0432\u0456\u0434 \u0441\u043f\u0456\u0432\u0431\u0435\u0441\u0456\u0434\u0438.","\u041e\u043f\u0442\u0438\u043c\u0430\u043b\u044c\u043d\u043e: \xab\u041c\u0435\u043d\u0456 \u0445\u043e\u0442\u0456\u043b\u043e\u0441\u044f \u0431 \u043f\u043e\u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438 \u0434\u043e\u0432\u0448\u0435, \u0430\u043b\u0435 \u0431\u0430\u0433\u0430\u0442\u043e \u0437\u0430\u043b\u0435\u0436\u0438\u0442\u044c \u0432\u0456\u0434 \u0442\u043e\u0433\u043e, \u0447\u0438 \u0432\u0434\u0430\u0441\u0442\u044c\u0441\u044f \u0443\u0441\u043f\u0456\u0448\u043d\u043e \u0432\u0438\u0440\u0456\u0448\u0443\u0432\u0430\u0442\u0438\u043f\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0456 \u0437\u0430\u0432\u0434\u0430\u043d\u043d\u044f, \u0447\u0438 \u0437\u043c\u043e\u0436\u0443 \u044f \u0440\u0435\u0430\u043b\u0456\u0437\u0443\u0432\u0430\u0442\u0438 \u0441\u0432\u0456\u0439 \u043f\u043e\u0442\u0435\u043d\u0446\u0456\u0430\u043b, \u0447\u0438 \u0432\u043f\u0438\u0448\u0443\u0441\u044f \u0432 \u043a\u043e\u043b\u0435\u043a\u0442\u0438\u0432\xbb.","10. \u0427\u0438 \u0437\u0434\u0430\u0442\u043d\u0456 \u0432\u0438 \u0432\u0438\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0432\u0435\u043b\u0438\u043a\u0456 \u043d\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f, \u0447\u0438 \u0437\u0433\u043e\u0434\u043d\u0456 \u0432\u0438 \u043d\u0430 \u043f\u0435\u0440\u0435\u0440\u043e\u0431\u043a\u0438?","\u0412\u0430\u0440\u0442\u043e \u0443\u0442\u043e\u0447\u043d\u0438\u0442\u0438, \u044f\u043a \u0447\u0430\u0441\u0442\u043e \u0431\u0443\u0432\u0430\u044e\u0442\u044c \u043f\u0435\u0440\u0435\u0440\u043e\u0431\u043a\u0438, \u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0447\u0430\u0441\u0443 \u0432\u043e\u043d\u0438 \u0437\u0430\u0439\u043c\u0430\u044e\u0442\u044c. \u042f\u043a\u0449\u043e \u0432\u0430\u0441 \u043f\u043b\u0430\u043d\u0443\u044e\u0442\u044c \u0427\u0430\u0441\u0442\u043e \u0437\u0430\u0439\u043c\u0430\u0442\u0438 \u0432 \u043d\u0435\u0440\u043e\u0431\u043e\u0447\u0438\u0439 \u0447\u0430\u0441 - \u0443\u0442\u043e\u0447\u043d\u0456\u0442\u044c, \u0447\u0438 \u043e\u043f\u043b\u0430\u0447\u0443\u044e\u0442\u044c\u0441\u044f \u043f\u043e\u043d\u0430\u0434\u043d\u043e\u0440\u043c\u043e\u0432\u0456. \u0406 \u0432\u0436\u0435 \u0432\u0438\u0445\u043e\u0434\u044f\u0447\u0438 \u0437 \u0446\u0438\u0445 \u0444\u0430\u043a\u0442\u0456\u0432 \u0431\u0443\u0434\u0443\u0439\u0442\u0435 \u0441\u0432\u043e\u044e \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u044c."],t.i)
$.b81=A.a(["\u0421\u043a\u043b\u0430\u0434\u0430\u044e\u0447\u0438 \u0440\u0435\u0437\u044e\u043c\u0435, \u0432\u0438 \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u043e \u043d\u0430\u043c\u0430\u0433\u0430\u0454\u0442\u0435\u0441\u044f \u043f\u043e\u043a\u0430\u0437\u0430\u0442\u0438 \u0441\u0435\u0431\u0435 \u0432 \u043a\u0440\u0430\u0449\u043e\u043c\u0443 \u0441\u0432\u0456\u0442\u043b\u0456. \u0429\u043e\u0431 \u043c\u0430\u0439\u0431\u0443\u0442\u043d\u0456\u0439 \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0435\u0446\u044c \u0432\u0441\u0435\u0440\u0439\u043e\u0437 \u0437\u0430\u0446\u0456\u043a\u0430\u0432\u0438\u0432\u0441\u044f \u0442\u0430\u043a\u0438\u043c \u043f\u0440\u0430\u0446\u0456\u0432\u043d\u0438\u043a\u043e\u043c. \u0410 \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e \u0437 \u043f\u0456\u0434\u0431\u043e\u0440\u0443 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443 \u0432\u0456\u0434\u043a\u043b\u0430\u043b\u043e \u0432\u0430\u0448\u0443 \u043f\u0430\u043f\u043a\u0443 \u0432 \u0441\u0442\u043e\u043f\u043a\u0443 \u0437 \u043f\u043e\u0437\u043d\u0430\u0447\u043a\u043e\u044e \xab\u041d\u0430\u0439\u043f\u0435\u0440\u0441\u043f\u0435\u043a\u0442\u0438\u0432\u043d\u0456\u0448\u0456\xbb?","\u041e\u0437\u043d\u0430\u0439\u043e\u043c\u0438\u0432\u0448\u0438\u0441\u044c \u0437 \u0432\u0435\u043b\u0438\u0447\u0435\u0437\u043d\u043e\u044e \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044e \u0440\u0435\u0437\u044e\u043c\u0435, \u043c\u0438 \u0437\u043c\u043e\u0433\u043b\u0438 \u0432\u0438\u0437\u043d\u0430\u0447\u0438\u0442\u0438 \u0448\u0456\u0441\u0442\u044c \u043d\u0430\u0439\u043f\u043e\u0448\u0438\u0440\u0435\u043d\u0456\u0448\u0438\u0445 \u043f\u043e\u043c\u0438\u043b\u043e\u043a \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0435\u043d\u0442\u0456\u0432. \u041e\u0437\u043d\u0430\u0439\u043e\u043c\u0442\u0435\u0441\u044f \u0437 \u043d\u0438\u043c\u0438, \u0449\u043e\u0431 \u0432\u0430\u0448\u0435 \u0440\u0435\u0437\u044e\u043c\u0435 \u0431\u0443\u043b\u043e \u0456\u0434\u0435\u0430\u043b\u044c\u043d\u0438\u043c!","1. \u041d\u0435\u043e\u0445\u0430\u0439\u043d\u0438\u0439, \u043d\u0435\u0432\u0438\u0447\u0438\u0442\u0430\u043d\u0438\u0439 \u0442\u0435\u043a\u0441\u0442","\u041f\u0440\u043e\u043f\u0443\u0441\u043a \u043a\u043e\u043c, \u043d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0440\u043e\u0437\u0434\u0456\u043b\u043e\u0432\u0438\u0445 \u0437\u043d\u0430\u043a\u0456\u0432, \u043e\u0440\u0444\u043e\u0433\u0440\u0430\u0444\u0456\u0447\u043d\u0456 \u043f\u043e\u043c\u0438\u043b\u043a\u0438 \u2014 \u043a\u0440\u0430\u0449\u043e\u0433\u043e \u0441\u043f\u043e\u0441\u043e\u0431\u0443 \u043f\u043e\u043a\u0430\u0437\u0430\u0442\u0438, \u0429\u043e \u0432\u0430\u043c \u043f\u043b\u044e\u0432\u0430\u0442\u0438 \u043d\u0430 \u0432\u0430\u043a\u0430\u043d\u0441\u0456\u044e, \u0437\u0430\u0433\u0430\u043b\u043e\u043c, \u043d\u0435\u043c\u0430\u0454. \u0426\u0456\u043b\u043a\u043e\u043c \u043d\u0435 \u0432\u0430\u0436\u043b\u0438\u0432\u043e, \u0427\u0438 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0432\u0430\u043c \u043d\u0430 \u0440\u043e\u0431\u043e\u0447\u043e\u043c\u0443 \u043c\u0456\u0441\u0446\u0456 \u0432\u0438\u044f\u0432\u043b\u044f\u0442\u0438 \u0437\u043d\u0430\u043d\u043d\u044f \u043f\u0443\u043d\u043a\u0442\u0443\u0430\u0446\u0456\u0457, \u043e\u0440\u0444\u043e\u0433\u0440\u0430\u0444\u0456\u0457 \u0442\u0430 \u0441\u0442\u0438\u043b\u0456\u0441\u0442\u0438\u043a\u0438. \u0421\u043f\u0440\u0430\u0432\u0430 \u0432 \u0442\u043e\u043c\u0443, \u0449\u043e \u0440\u0435\u0437\u044e\u043c\u0435 - \u0446\u0435 \u0432\u0430\u0448\u0435 \u043e\u0431\u043b\u0438\u0447\u0447\u044f, \u0432\u0430\u0448 \u043a\u043e\u0441\u0442\u044e\u043c, \u0432\u0430\u0448\u0435 \u0432\u0441\u0435. \u0422\u0430\u043a, \u0433\u043e\u043b\u043e\u0432\u043d\u0435 \u2014 \u0434\u043e\u0431\u0440\u0435 \u0440\u043e\u0431\u0438\u0442\u0438 \u0441\u0432\u043e\u044e \u0440\u043e\u0431\u043e\u0442\u0443. \u0410\u043b\u0435 \u043f\u043e\u0441\u0430\u0434\u0443 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0441\u043f\u043e\u0447\u0430\u0442\u043a\u0443 \u0437\u0430\u0432\u043e\u044e\u0432\u0430\u0442\u0438, \u0406 \u044f\u043a\u0449\u043e \u0440\u0430\u043d\u0456\u0448\u0435 \u0437\u0434\u043e\u0431\u0443\u0432\u0430\u0447\u0430 \u0437\u0443\u0441\u0442\u0440\u0456\u0447\u0430\u043b\u0438 \xab\u043f\u043e \u043e\u0434\u044f\u0437\u0456\xbb, \u0437\u0430\u0440\u0430\u0437, \u0432 \u0435\u0440\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0439\u043d\u0438\u0445 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0456\u0439, \u0437\u0443\u0441\u0442\u0440\u0456\u0447\u0430\u044e\u0442\u044c \u043f\u043e \u0440\u0435\u0437\u044e\u043c\u0435. \u041f\u0440\u043e\u0441\u0442\u043e \u0443\u044f\u0432\u0456\u0442\u044c, \u0449\u043e \u043b\u044e\u0434\u0438\u043d\u0430 \u043f\u0440\u0438\u0445\u043e\u0434\u0438\u0442\u044c \u043d\u0430 \u0441\u043f\u0456\u0432\u0431\u0435\u0441\u0456\u0434\u0443 \u0432 \u043c'\u044f\u0442\u0456\u0439 \u043f\u0456\u0436\u0430\u043c\u0456. \u0427\u0438 \u0434\u043e\u0432\u0456\u0440\u0438\u0442\u0435 \u0439\u043e\u043c\u0443 \u0441\u0435\u0440\u0439\u043e\u0437\u043d\u0443 \u043f\u043e\u0441\u0430\u0434\u0443? \u041d\u0435 \u0434\u0443\u043c\u0430\u0454\u043c\u043e.",'\u0429\u0435 \u043f\u0440\u0438\u043a\u043b\u0430\u0434. \u0412\u0438 \u0437\u0430\u0445\u043e\u0434\u0438\u0442\u0435 \u0432 \u0456\u043d\u0442\u0435\u0440\u043d\u0435\u0442-\u043c\u0430\u0433\u0430\u0437\u0438\u043d \u0456 \u0431\u0430\u0447\u0438\u0442\u0435, \u0449\u043e \u0432\u0456\u043d \u0442\u043e\u0440\u0433\u0443\u0454 \u0441\u043c\u0430\u0440\u0442\u0444\u043e\u043d\u0430\u043c\u0438 "Ipone", "Sasung", "Nokiya". \u0427\u0438 \u0432\u0438\u043d\u0438\u043a\u043d\u0435 \u0434\u043e\u0432\u0456\u0440\u0430 \u0434\u043e \u0442\u0430\u043a\u043e\u0433\u043e \u043f\u0440\u043e\u0434\u0430\u0432\u0446\u044f? \u042f\u043a\u0449\u043e \u0432\u0456\u043d \u043f\u043e\u0433\u0430\u043d\u043e \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0438\u0432 \u0442\u0435\u043a\u0441\u0442\u0438, \u0442\u043e, \u043d\u0430\u043f\u0435\u0432\u043d\u043e, \u0456 \u0434\u043e \u0456\u043d\u0448\u0438\u0445 \u0441\u0432\u043e\u0457\u0445 \u043e\u0431\u043e\u0432\'\u044f\u0437\u043a\u0456\u0432 \u0441\u0442\u0430\u0432\u0438\u0442\u044c\u0441\u044f \u043d\u0435\u0434\u0431\u0430\u043b\u043e, \u0432\u0456\u0440\u043d\u043e?',"\u041e\u0431\u043e\u0432'\u044f\u0437\u043a\u043e\u0432\u043e \u0443\u0432\u0430\u0436\u043d\u043e \u043f\u0435\u0440\u0435\u0447\u0438\u0442\u0443\u0439\u0442\u0435 \u0432\u0441\u0435, \u0449\u043e \u0432\u0438 \u0432\u0456\u0434\u043f\u0440\u0430\u0432\u043b\u044f\u0454\u0442\u0435 \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u044e. \u042f\u043a\u0449\u043e \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u0430 \u0440\u043e\u0441\u0456\u0439\u0441\u044c\u043a\u0430 \u2014 \u0432\u0430\u0448\u0435 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u043d\u0435 \u043c\u0456\u0441\u0446\u0435, \u043d\u0435\u0445\u0430\u0439 \u0434\u043e\u043f\u043e\u043c\u043e\u0436\u0435 \u0434\u0440\u0443\u0433-\u0444\u0456\u043b\u043e\u043b\u043e\u0433. \u0423 \u043a\u0440\u0430\u0439\u043d\u044c\u043e\u043c\u0443 \u0432\u0438\u043f\u0430\u0434\u043a\u0443 \u0437\u0430\u0432\u0436\u0434\u0438 \u043c\u043e\u0436\u043d\u0430 \u0437\u043d\u0430\u0439\u0442\u0438 \u043d\u0435\u0434\u043e\u0440\u043e\u0433\u043e\u0433\u043e \u043a\u043e\u0440\u0435\u043a\u0442\u043e\u0440\u0430 \u0430\u0431\u043e \u0441\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u0442\u0438\u0441\u044f \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u043e\u044e \u043e\u0440\u0444\u043e\u0433\u0440\u0430\u0444\u0456\u0457 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0438 Word.","2. \u041d\u0435\u0434\u043e\u0440\u0435\u0447\u043d\u0435 \u0444\u043e\u0442\u043e","\u0424\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0456\u044f \u0432 \u0440\u0435\u0437\u044e\u043c\u0435 \u2014 \u0446\u0435 \u043a\u0440\u0443\u0442\u043e. \u0412\u0438 \u043f\u043e\u043a\u0430\u0437\u0443\u0454\u0442\u0435, \u0449\u043e \u043f\u0440\u0438\u0445\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0432\u0430\u043c \u043d\u0456\u0447\u043e\u0433\u043e: \u043e\u0441\u044c \u044f \u0440\u043e\u0437\u043f\u043e\u0432\u0456\u0432 \u043f\u0440\u043e \u0441\u0432\u043e\u0457 \u043d\u0430\u0432\u0438\u0447\u043a\u0438 \u0442\u0430 \u0434\u043e\u0441\u0432\u0456\u0434, \u0422\u0430 \u043e\u0441\u044c \u044f \u0441\u0430\u043c, \u0440\u0430\u0434\u0438\u0439 \u043f\u043e\u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438 \u0432 \u0445\u043e\u0440\u043e\u0448\u0456\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457. \u0426\u0435 \u043f\u0456\u0434\u043a\u0443\u043f\u043e\u0432\u0443\u0454.","\u0410\u043b\u0435 \u0446\u0435 \u043d\u0435 \u043f\u043e\u0432\u0438\u043d\u043d\u043e \u0431\u0443\u0442\u0438 \u0444\u043e\u0442\u043e \u0437 \u043f\u043b\u044f\u0436\u0443 \u0432 \u043a\u0443\u043f\u0430\u043b\u044c\u043d\u0438\u043a\u0443 \u0430\u0431\u043e \u0437 \u0434\u0440\u0443\u0436\u043d\u044c\u043e\u0457 \u043f\u0438\u044f\u0442\u0438\u043a\u0438, \u0444\u043e\u0442\u043e \u0437 \u0433\u0440\u0430\u0439\u043b\u0438\u0432\u0438\u043c \u0432\u0438\u0440\u0430\u0437\u043e\u043c \u043e\u0431\u043b\u0438\u0447\u0447\u044f \u0430\u0431\u043e \u043d\u0435\u0434\u0432\u043e\u0437\u043d\u0430\u0447\u043d\u043e\u044e \u043f\u043e\u0437\u043e\u044e. \u041d\u0430\u0439\u0447\u0430\u0441\u0442\u0456\u0448\u0435 \u043d\u0435\u0434\u043e\u0440\u0435\u0447\u043d\u0456 \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0456\u0457 \u043d\u0430\u0434\u0441\u0438\u043b\u0430\u044e\u0442\u044c \u0434\u0456\u0432\u0447\u0430\u0442\u0430.","\u0412\u0430\u0440\u0442\u043e \u0437\u0430\u043f\u0430\u043c'\u044f\u0442\u0430\u0442\u0438, \u0449\u043e \u0456\u0434\u0435\u0430\u043b\u044c\u043d\u0430 \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0456\u044f: \u0446\u0435 \u043a\u043e\u0441\u0442\u044e\u043c, \u0431\u043b\u0438\u0437\u044c\u043a\u0438\u0439 \u0434\u043e \u043a\u043b\u0430\u0441\u0438\u0447\u043d\u043e\u0433\u043e, \u043d\u0435 \u043d\u0430\u043f\u0440\u0443\u0436\u0435\u043d\u0430, \u0430\u043b\u0435 \u0439 \u043d\u0435 \u0440\u043e\u0437\u0432'\u044f\u0437\u043d\u0430 \u043f\u043e\u0437\u0430. \u0406 \u0442\u0430\u043a, \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0432 \u0430\u043d\u0444\u0430\u0441. \u0410 \u0431\u0456\u043a\u0456\u043d\u0456 \u0447\u0438 \u0448\u043e\u0440\u0442\u0438 \u2014 \u043b\u0438\u0448\u0435 \u0434\u043b\u044f \u0442\u0438\u0445, \u0445\u0442\u043e \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0442\u044c \u043a\u0430\u0441\u0442\u0438\u043d\u0433 \u0443 \u043c\u043e\u0434\u0435\u043b\u044c\u043d\u0443 \u0430\u0433\u0435\u043d\u0446\u0456\u044e.","3. \u041a\u043e\u043d\u0442\u0430\u043a\u0442\u0438","\u0420\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0435\u0446\u044c \u0437\u0430\u0446\u0456\u043a\u0430\u0432\u0438\u0432\u0441\u044f \u0440\u0435\u0437\u044e\u043c\u0435, \u0445\u043e\u0447\u0435 \u043e\u0431\u0433\u043e\u0432\u043e\u0440\u0438\u0442\u0438 \u0443\u043c\u043e\u0432\u0438 \u043c\u0430\u0439\u0431\u0443\u0442\u043d\u044c\u043e\u0457 \u0441\u043f\u0456\u0432\u043f\u0440\u0430\u0446\u0456, \u043d\u0430\u0431\u0438\u0440\u0430\u0454 \u0442\u0435\u043b\u0435\u0444\u043e\u043d\u043d\u0438\u0439 \u043d\u043e\u043c\u0435\u0440.... \u0414\u0438\u0432\u043e\u0432\u0438\u0436\u043d\u0438\u0439 \u0444\u0430\u043a\u0442: \u043d\u0430 \u0446\u044c\u043e\u043c\u0443 \u0435\u0442\u0430\u043f\u0456 \u0432\u0456\u0434\u0441\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0442\u0435\u0436 \u0447\u0438\u043c\u0430\u043b\u043e \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0456\u0432. \u041b\u044e\u0434\u0438\u043d\u0430 \u043d\u0435 \u043e\u0442\u0440\u0438\u043c\u0443\u0454 \u0431\u0430\u0436\u0430\u043d\u0435 \u043c\u0456\u0441\u0446\u0435 \u0440\u043e\u0431\u043e\u0442\u0438 \u043f\u0440\u043e\u0441\u0442\u043e \u0442\u043e\u043c\u0443, \u0429\u043e \u0434\u043e \u043d\u044c\u043e\u0433\u043e \u0441\u043a\u043b\u0430\u0434\u043d\u043e \u0434\u043e\u0434\u0437\u0432\u043e\u043d\u0438\u0442\u0438\u0441\u044f. \u0414\u0432\u0456-\u0442\u0440\u0438 \u0441\u043f\u0440\u043e\u0431\u0438 \u2014 \u0456 \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442 \u0432\u0438\u043a\u0440\u0435\u0441\u043b\u044e\u0454\u0442\u044c\u0441\u044f.","\u0422\u0430\u043a\u043e\u0433\u043e \u043a\u043e\u043d\u0444\u0443\u0437\u0443 \u0443\u043d\u0438\u043a\u043d\u0443\u0442\u0438 \u043f\u0440\u043e\u0441\u0442\u043e: \u0434\u043e\u0441\u0442\u0430\u0442\u043d\u044c\u043e \u043d\u0430\u043f\u0438\u0441\u0430\u0442\u0438 \u0447\u0430\u0441, \u0443 \u044f\u043a\u0438\u0439 \u0432\u0430\u043c \u0437\u0440\u0443\u0447\u043d\u043e \u043f\u0440\u0438\u0439\u043c\u0430\u0442\u0438 \u0434\u0437\u0432\u0456\u043d\u043a\u0438 \u0442\u0430 \u0437\u0430\u043b\u0438\u0448\u0438\u0442\u0438 \u0441\u0432\u0456\u0439 e-mail. \u0410\u0434\u0440\u0435\u0441\u0430 e-mail \u043d\u0435 \u043f\u043e\u0432\u0438\u043d\u043d\u0430 \u0431\u0443\u0442\u0438 \u0444\u0440\u0438\u0432\u043e\u043b\u044c\u043d\u043e\u044e: SmeshnoyGus11, nimfetka777, ILoveSex666 \u2014 \u0432\u043a\u0440\u0430\u0439 \u043d\u0435\u0432\u0434\u0430\u043b\u0456 \u0432\u0430\u0440\u0456\u0430\u043d\u0442\u0438. \u0417\u0430\u0432\u0435\u0434\u0456\u0442\u044c \u0430\u0434\u0440\u0435\u0441\u0443 \u0456\u0437 \u0441\u043e\u043b\u0456\u0434\u043d\u043e\u044e \u043d\u0430\u0437\u0432\u043e\u044e. \u0406 \u043d\u0435 \u0437\u0430\u0431\u0443\u0432\u0430\u0439\u0442\u0435 \u0449\u043e\u0434\u043d\u044f \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u044f\u0442\u0438 \u043f\u043e\u0448\u0442\u0443.","4. \u041d\u0435\u0434\u043e\u0440\u0435\u0447\u043d\u0430 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f","\u0423 \u0446\u044c\u043e\u043c\u0443 \u043f\u0443\u043d\u043a\u0442\u0456 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u0435 \u043f\u0440\u043e\u0431\u043b\u0435\u043c \u0431\u0443\u0432\u0430\u0454 \u043f\u0440\u0438 \u0432\u043a\u0430\u0437\u0456\u0432\u0446\u0456 \u043e\u0441\u0432\u0456\u0442\u0438 \u0442\u0430 \u0434\u043e\u0441\u0432\u0456\u0434\u0443. \u041a\u0443\u0440\u0441\u0438 \u0437 \u0434\u0440\u0435\u0441\u0438\u0440\u0443\u0432\u0430\u043d\u043d\u044f \u0440\u0438\u0431\u043e\u043a \u043d\u0435 \u0434\u043e\u043f\u043e\u043c\u043e\u0436\u0443\u0442\u044c \u0443 \u0440\u043e\u0431\u043e\u0442\u0456 \u0431\u0443\u0445\u0433\u0430\u043b\u0442\u0435\u0440\u0430. \u0410 \u0441\u043e\u043b\u0456\u0434\u043d\u0438\u0439 \u0442\u0440\u0435\u043d\u0435\u0440\u0441\u044c\u043a\u0438\u0439 \u0441\u0442\u0430\u0436 \u0443 \u0431\u043e\u043b\u043e\u0442\u043d\u043e\u043c\u0443 \u0444\u0443\u0442\u0431\u043e\u043b\u0456 \u043d\u0435 \u0434\u043e \u0434\u0432\u043e\u0440\u0443 \u044e\u0440\u0438\u0434\u0438\u0447\u043d\u0456\u0439 \u0444\u0456\u0440\u043c\u0456.","\u0412\u0430\u0440\u0442\u043e \u043f\u0438\u0441\u0430\u0442\u0438 \u0442\u0456\u043b\u044c\u043a\u0438 \u043f\u0440\u043e \u0442\u043e\u0439 \u0434\u043e\u0441\u0432\u0456\u0434, \u044f\u043a\u0438\u0439 \u0432\u0430\u043c \u0442\u0430\u043a \u0447\u0438 \u0456\u043d\u0430\u043a\u0448\u0435 \u043c\u043e\u0436\u0435 \u0441\u0442\u0430\u0442\u0438 \u0432 \u043d\u0430\u0433\u043e\u0434\u0456 \u043d\u0430 \u043d\u043e\u0432\u043e\u043c\u0443 \u0440\u043e\u0431\u043e\u0447\u043e\u043c\u0443 \u043c\u0456\u0441\u0446\u0456. \u0412\u0430\u043c \u043d\u0430\u043f\u0435\u0432\u043d\u043e \u0454 \u0447\u0438\u043c \u043f\u043e\u0445\u0432\u0430\u043b\u0438\u0442\u0438\u0441\u044f \u0456 \u043f\u043e\u0437\u0430 \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u0439\u043d\u043e\u044e \u0441\u0444\u0435\u0440\u043e\u044e, \u0430\u043b\u0435 \u043f\u043e\u0431\u0435\u0440\u0435\u0436\u0456\u0442\u044c \u043b\u044e\u0434\u0438\u043d\u0443, \u042f\u043a\u0438\u0439 \u0437 \u043c\u043e\u0440\u044f \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u0432\u0438\u0432\u0443\u0436\u0443\u0432\u0430\u0442\u0438\u043c\u0435 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u0443. \u0406 \u043f\u0430\u043c'\u044f\u0442\u0430\u0439\u0442\u0435: \u044f\u043a\u0449\u043e \u043c\u043e\u0440\u0435 \u0434\u0443\u0436\u0435 \u0432\u0435\u043b\u0438\u043a\u0435, \u043f\u0440\u043e\u0446\u0435\u0441 \u0439\u043e\u043c\u0443 \u043c\u043e\u0436\u0435 \u043d\u0430\u0431\u0440\u0438\u0434\u043d\u0443\u0442\u0438.","\u0412\u0430\u0436\u043b\u0438\u0432\u0456 \u0434\u0430\u043d\u0456 \u0442\u0435\u0436 \u0431\u0430\u0436\u0430\u043d\u043e \u043f\u043e\u0434\u0430\u0432\u0430\u0442\u0438 \u0441\u0442\u0438\u0441\u043b\u043e. \u0417\u0432\u0438\u0447\u0430\u0439\u043d\u043e, \u0434\u0432\u0456-\u0442\u0440\u0438 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438 \u0432\u0430\u0448\u0438\u0445 \u043d\u0430\u0432\u0438\u0447\u043e\u043a \u0442\u0430 \u0434\u043e\u0441\u044f\u0433\u043d\u0435\u043d\u044c \u2013 \u0446\u0435 \u0441\u043e\u043b\u0456\u0434\u043d\u043e. \u0410\u043b\u0435 \u044f\u043a\u0449\u043e \u043f\u0440\u043e \u0433\u043e\u043b\u043e\u0432\u043d\u0435 \u0440\u043e\u0437\u043f\u043e\u0432\u0456\u0441\u0442\u0438 \u043a\u043e\u0440\u043e\u0442\u043a\u043e \u043d\u0430 \u0441\u0430\u043c\u043e\u043c\u0443 \u043f\u043e\u0447\u0430\u0442\u043a\u0443 \u0440\u0435\u0437\u044e\u043c\u0435, \u0432\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u0431\u0443\u0434\u0435 \u043d\u0430\u0432\u0456\u0442\u044c \u0441\u0438\u043b\u044c\u043d\u0456\u0448\u0438\u043c. \u0406\u0434\u0435\u0430\u043b\u044c\u043d\u0438\u0439 \u0444\u043e\u0440\u043c\u0430\u0442 \u2014 \u043e\u0434\u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0430.","5. \u0420\u043e\u0437\u043f\u043b\u0438\u0432\u0447\u0430\u0441\u0442\u0430 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f","\u041f\u0438\u0448\u0435, \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, \u0437\u0434\u043e\u0431\u0443\u0432\u0430\u0447 \u0406\u0432\u0430\u043d\u043e\u0432 \u0406\u0432\u0430\u043d \u0406\u0432\u0430\u043d\u043e\u0432\u0438\u0447: \u201c\u0421\u0456\u043c \u0440\u043e\u043a\u0456\u0432 \u0440\u043e\u0431\u043e\u0442\u0438 \u043d\u0430 \u043a\u0435\u0440\u0456\u0432\u043d\u0438\u0445 \u043f\u043e\u0441\u0430\u0434\u0430\u0445\u201d. \u0412\u0438\u043d\u0438\u043a\u0430\u0454 \u043f\u0438\u0442\u0430\u043d\u043d\u044f: \u0447\u043e\u043c\u0443 \u0431\u0435\u0437 \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u0438\u043a\u0438? \u041c\u043e\u0436\u043b\u0438\u0432\u043e, \u0406\u0432\u0430\u043d\u043e\u0432 \u0431\u0430\u0433\u0430\u0442\u043e \u0440\u0430\u0437\u0456\u0432 \u0437\u043c\u0456\u043d\u044e\u0432\u0430\u0432 \u043c\u0456\u0441\u0446\u0435 \u0440\u043e\u0431\u043e\u0442\u0438? \u0410\u0431\u043e \u0444\u0456\u0440\u043c\u0430 \u043d\u0435 \u0432\u043a\u0430\u0437\u0430\u043d\u0430 \u0442\u043e\u043c\u0443","\u0429\u043e \u0437\u0434\u043e\u0431\u0443\u0432\u0430\u0447 \u0437\u0430\u043b\u0438\u0448\u0438\u0432 \u043f\u0440\u043e \u0441\u0435\u0431\u0435 \u043f\u043e\u0433\u0430\u043d\u0443 \u043f\u0430\u043c'\u044f\u0442\u044c? \u0427\u0438\u043c \u0431\u0456\u043b\u044c\u0448 \u0440\u043e\u0437\u043f\u043b\u0438\u0432\u0447\u0430\u0441\u0442\u0430 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f, \u0442\u0438\u043c \u0441\u0438\u043b\u044c\u043d\u0456\u0448\u0430 \u043d\u0435\u0434\u043e\u0432\u0456\u0440\u0430 \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u044f.","\u0427\u0438\u043c \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u0456\u0448\u0456 \u0444\u0430\u043a\u0442\u0438, \u0442\u0438\u043c \u043a\u0440\u0430\u0449\u0435. \u0420\u044f\u0434\u043e\u043a \xab\u0421\u0456\u043c \u0440\u043e\u043a\u0456\u0432 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0432 \u0443 \u0444\u0456\u0440\u043c\u0456 \u201eGeneration \u0421\u0456\u201c \u043d\u0430 \u043f\u043e\u0441\u0430\u0434\u0456 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0430 \u0437 \u043c\u0430\u0440\u043a\u0435\u0442\u0438\u043d\u0433\u0443\xbb \u043d\u0435 \u0432\u0438\u043a\u043b\u0438\u043a\u0430\u0454 \u043d\u0435\u043f\u043e\u0442\u0440\u0456\u0431\u043d\u0438\u0445 \u0441\u0443\u043c\u043d\u0456\u0432\u0456\u0432 \u0456 \u0437\u0432\u043e\u0434\u0438\u0442\u044c \u043d\u0430\u043d\u0456\u0432\u0435\u0446\u044c \u043c\u043e\u0436\u043b\u0438\u0432\u0456\u0441\u0442\u044c \u043f\u043e\u044f\u0432\u0438 \u043d\u0435\u0433\u0430\u0442\u0438\u0432\u043d\u0438\u0445 \u0442\u0440\u0430\u043a\u0442\u0443\u0432\u0430\u043d\u044c. \u0420\u043e\u0437\u043c\u0456\u0440 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457, \u0457\u0457 \u0441\u0444\u0435\u0440\u0430 \u0434\u0456\u044f\u043b\u044c\u043d\u043e\u0441\u0442\u0456 - \u0446\u0435 \u0442\u0435\u0436 \u0432\u0430\u0436\u043b\u0438\u0432\u0430 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f \u0434\u043b\u044f \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u043f\u043e\u0437\u0438\u0446\u0456\u0439 (\u0432\u0456\u0434 \u0431\u0443\u0445\u0433\u0430\u043b\u0442\u0435\u0440\u0456\u0432 \u0434\u043e \u043b\u0430\u043d\u043a\u0438, \u0449\u043e \u0443\u043f\u0440\u0430\u0432\u043b\u044f\u0454). \u0420\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u0456 \u043b\u044e\u0431\u043b\u044f\u0442\u044c \u043a\u043e\u043b\u0438 \u0432 \u0440\u0435\u0437\u044e\u043c\u0435 \u0432\u043a\u0430\u0437\u0430\u043d\u0456 \u0432\u0438\u043c\u0456\u0440\u043d\u0456 \u0432 \u0446\u0438\u0444\u0440\u0430\u0445 \u0434\u043e\u0441\u044f\u0433\u043d\u0435\u043d\u043d\u044f.","6. \u0411\u043e\u0433\u0430\u0442\u0438\u0440\u0441\u044c\u043a\u0435 \u0437\u0430\u043c\u0430\u0445","\xab\u041f\u0440\u0435\u0442\u0435\u043d\u0434\u0443\u044e \u043d\u0430 \u043f\u043e\u0441\u0430\u0434\u0438 \u0441\u0442\u0430\u0440\u0448\u043e\u0433\u043e \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430, \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0442\u0430 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0430 \u0437 \u043f\u0440\u043e\u0434\u0430\u0436\u0443\xbb \u2014 \u0442\u0430\u043a\u0435 \u043c\u043e\u0436\u043d\u0430 \u043d\u0430\u043f\u0438\u0441\u0430\u0442\u0438, \u0422\u0456\u043b\u044c\u043a\u0438 \u043a\u043e\u043b\u0438 \u0441\u0430\u043c \u0441\u043e\u0431\u0456 \u043d\u0430\u0448\u043a\u043e\u0434\u0438\u0442\u0438 \u0445\u043e\u0447\u0435\u0448. \u041f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f \u0437\u0440\u043e\u0437\u0443\u043c\u0456\u043b\u0435: \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0435\u043d\u0442 \u0445\u043e\u0447\u0435 \u0431\u0443\u0442\u0438 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u043e\u043c, \u0430\u043b\u0435 \u044f\u043a\u0449\u043e \u0439\u043e\u043c\u0443 \u0437\u0430\u043f\u0440\u043e\u043f\u043e\u043d\u0443\u044e\u0442\u044c \u043f\u043e\u0441\u0430\u0434\u0443 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430, \u0422\u043e\u0439 \u043d\u0435 \u0432\u0456\u0434\u043c\u043e\u0432\u0438\u0442\u044c\u0441\u044f, \u0431\u043e \u0440\u043e\u0431\u043e\u0442\u0430 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u0430 \u0442\u0443\u0442 \u0456 \u0437\u0430\u0440\u0430\u0437. \u041e\u0441\u044c \u0442\u0456\u043b\u044c\u043a\u0438 \u0440\u0456\u0434\u043a\u043e \u044f\u043a\u0456\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457 \u043f\u043e\u0442\u0440\u0456\u0431\u0435\u043d \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440, \u0430\u043c\u0431\u0456\u0446\u0456\u0457 \u044f\u043a\u043e\u0433\u043e \u0437\u0430\u0434\u043e\u0432\u043e\u043b\u044c\u043d\u044f\u044e\u0442\u044c\u0441\u044f \u0439 \u0456\u043d\u0448\u043e\u044e \u043f\u043e\u0441\u0430\u0434\u043e\u044e.","\u0406\u043d\u0448\u0430 \u0441\u0438\u0442\u0443\u0430\u0446\u0456\u044f: \u0432\u0438 \u0434\u043e\u0441\u0442\u0430\u0442\u043d\u044c\u043e \u043a\u0432\u0430\u043b\u0456\u0444\u0456\u043a\u043e\u0432\u0430\u043d\u0456 \u0442\u0430 \u0440\u0456\u0437\u043d\u043e\u0431\u0456\u0447\u043d\u043e \u0440\u043e\u0437\u0432\u0438\u043d\u0435\u043d\u0456, \u0449\u043e\u0431 \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0443\u0432\u0430\u0442\u0438 \u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0430 \u043f\u043e\u0441\u0430\u0434, \u0422\u0456, \u0445\u0442\u043e \u043d\u0435 \u043f\u0456\u0434\u043f\u043e\u0440\u044f\u0434\u043a\u043e\u0432\u0430\u043d\u0438\u0439 \u043e\u0434\u0438\u043d \u043e\u0434\u043d\u043e\u043c\u0443. \u041d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, \u0456\u0437 \u0437\u0430\u0434\u043e\u0432\u043e\u043b\u0435\u043d\u043d\u044f\u043c \u0440\u043e\u0431\u0438\u0442\u0435 \u0434\u0438\u0437\u0430\u0439\u043d, \u0430\u043b\u0435 \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438 \u0456 \u043a\u043e\u043f\u0456\u0440\u0430\u0439\u0442\u0435\u0440\u043e\u043c. \u0426\u0435 \u043f\u0440\u0438\u043f\u0443\u0441\u0442\u0438\u043c\u043e, \u0430\u043b\u0435 \u0432\u0430\u0440\u0442\u043e \u0440\u043e\u0437\u0431\u0438\u0442\u0438 \u0440\u0435\u0437\u044e\u043c\u0435 \u043d\u0430 \u0447\u0430\u0441\u0442\u0438\u043d\u0438: \u043d\u0435\u0445\u0430\u0439 \u0434\u0438\u0437\u0430\u0439\u043d \u0442\u0430 \u043a\u043e\u043f\u0456\u0440\u0430\u0439\u0442\u0438\u043d\u0433 \u043d\u0435 \u043f\u043b\u0443\u0442\u0430\u044e\u0442\u044c\u0441\u044f."],t.i)
