$.bap=A.a(["\u0428\u0432\u0438\u0434\u043a\u0456\u0441\u0442\u044c \u043f\u0456\u0434\u0431\u043e\u0440\u0443 \u0441\u043f\u0456\u0432\u0440\u043e\u0431\u0456\u0442\u043d\u0438\u043a\u0430 - \u0437\u0430\u0432\u0436\u0434\u0438 \u0430\u043a\u0442\u0443\u0430\u043b\u044c\u043d\u0430 \u0431\u0430\u0437\u0430 \u0440\u0435\u0437\u044e\u043c\u0435 \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0441\u0442\u0456\u0432.","\u0427\u0456\u0442\u043a\u0435 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u0456\u0441\u0442\u044c \u043e\u0447\u0456\u043a\u0443\u0432\u0430\u043d\u043d\u044f\u043c - \u0437 \u0442\u043e\u0447\u043a\u0438 \u0437\u043e\u0440\u0443 \u0434\u043e\u0441\u0432\u0456\u0434\u0443, \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u043e\u043d\u0430\u043b\u0456\u0437\u043c\u0443 \u0442\u0430 \u043e\u0441\u043e\u0431\u0438\u0441\u0442\u0456\u0441\u043d\u0438\u0445 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0441\u0442\u0438\u043a.","\u041f\u043e\u0448\u0443\u043a \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0437 \u043f\u0440\u043e\u0434\u0430\u0436\u0443, \u043f\u0456\u0434\u0431\u0456\u0440 \u0442\u0430 \u043e\u0446\u0456\u043d\u043a\u0430 \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0441\u0442\u0456\u0432 \u0432 \u0441\u0444\u0435\u0440\u0456 \u043f\u0440\u043e\u0434\u0430\u0436\u0443 - \u0446\u0435 \u043d\u0430\u0448\u0430 \u043e\u0441\u043d\u043e\u0432\u043d\u0430 \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u044f.","\u0412\u0456\u0434\u0442\u043e\u0447\u0435\u043d\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u0440\u0435\u043a\u0440\u0443\u0442\u0438\u043d\u0433\u0443 \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0443\u0454 \u043e\u043f\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u0438\u0439 \u043f\u0456\u0434\u0431\u0456\u0440 \u043d\u0430\u0439\u043f\u0440\u043e\u0444\u0435\u0441\u0456\u0439\u043d\u0456\u0448\u0438\u0445 \u0442\u0430 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0438\u0432\u043d\u0438\u0445 \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0441\u0442\u0456\u0432.","\u0422\u0440\u043e\u0454\u043d\u0430 \u0433\u0430\u0440\u0430\u043d\u0442\u0456\u044f \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0443 - \u043e\u043f\u043b\u0430\u0442\u0430 \u043b\u0438\u0448\u0435 \u0437\u0430 100% \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442!"],t.i)
