$.ba3=A.a(["HR-\u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440;","\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0437 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443 (HR);","\u0422\u0440\u0435\u043d\u0456\u043d\u0433-\u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440;","\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0437 \u0440\u043e\u0437\u0432\u0438\u0442\u043a\u0443 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443;","\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0437 \u043d\u0430\u0432\u0447\u0430\u043d\u043d\u044f;","\u0420\u0435\u043a\u0440\u0443\u0442\u0435\u0440;","HR-\u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0456\u0441\u0442;","HR-\u0431\u0456\u0437\u043d\u0435\u0441-\u043f\u0430\u0440\u0442\u043d\u0435\u0440."],t.i)
$.ba4=A.a(["HR-\u043f\u0456\u0434\u0440\u043e\u0437\u0434\u0456\u043b\u0438 \u0432\u0435\u043b\u0438\u043a\u0438\u0445 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0439;","HR-\u0432\u0456\u0434\u0434\u0456\u043b\u0438;","\u0424\u0456\u043b\u0456\u0430\u043b\u0438;","IT-\u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457;","\u0422\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u043d\u0456 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457;","\u0411\u0443\u0434\u0456\u0432\u0435\u043b\u044c\u043d\u0456 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457;","\u0424\u0456\u043d\u0430\u043d\u0441\u043e\u0432\u0438\u0439 \u0441\u0435\u043a\u0442\u043e\u0440;","\u0442\u0430 \u0456\u043d\u0448\u0435."],t.i)
$.ba1=A.a(["\u041f\u043e\u0442\u0440\u0456\u0431\u0435\u043d \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0437 \u043f\u0456\u0434\u0431\u043e\u0440\u0443 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443? \u0421\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0441\u0442\u0438 \u043a\u0430\u0434\u0440\u043e\u0432\u043e\u0433\u043e \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u0430 HR-Library \u0433\u043e\u0442\u043e\u0432\u0456 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e \u0448\u0432\u0438\u0434\u043a\u043e \u0442\u0430 \u044f\u043a\u0456\u0441\u043d\u043e \u0432\u0438\u0440\u0456\u0448\u0438\u0442\u0438 \u043a\u0430\u0434\u0440\u043e\u0432\u0443 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0443. \u0411\u0456\u043b\u044c\u0448\u0435 16 \u0440\u043e\u043a\u0456\u0432 \u043c\u0438 \u0437\u0430\u0439\u043c\u0430\u0454\u043c\u043e\u0441\u044f \u0432\u0456\u0434\u0431\u043e\u0440\u043e\u043c \u0440\u0435\u0437\u044e\u043c\u0435 \u0441\u043f\u0440\u0430\u0432\u0436\u043d\u0456\u0445 \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u043e\u043d\u0430\u043b\u0456\u0432 \u0456 \u0437\u0430\u043f\u043e\u0432\u043d\u0435\u043d\u043d\u044f\u043c \u0432\u0430\u043a\u0430\u043d\u0441\u0456\u0439 \u0443 \u0432\u0441\u0456\u0445 \u043d\u0430\u043f\u0440\u044f\u043c\u043a\u0430\u0445 HR-\u0441\u0444\u0435\u0440\u0438:","\u043f\u0456\u0434\u0431\u0456\u0440 \u0442\u0430 \u0430\u0434\u0430\u043f\u0442\u0430\u0446\u0456\u044f \u0441\u043f\u0456\u0432\u0440\u043e\u0431\u0456\u0442\u043d\u0438\u043a\u0456\u0432;","\u043a\u0430\u0434\u0440\u043e\u0432\u0435 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u043e\u043e\u0431\u0456\u0433 \u0442\u0430 \u0430\u0434\u043c\u0456\u043d\u0456\u0441\u0442\u0440\u0443\u0432\u0430\u043d\u043d\u044f;","\u043d\u0430\u0432\u0447\u0430\u043d\u043d\u044f \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443 \u0442\u0430 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u043d\u044f \u0442\u0440\u0435\u043d\u0456\u043d\u0433\u0456\u0432;","\u0440\u043e\u0437\u0440\u043e\u0431\u043a\u0430 \u0431\u0456\u0437\u043d\u0435\u0441-\u043f\u0440\u043e\u0446\u0435\u0441\u0456\u0432 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457;","\u043a\u0430\u0440'\u0454\u0440\u043d\u0435 \u043f\u043b\u0430\u043d\u0443\u0432\u0430\u043d\u043d\u044f \u0442\u0430 \u0440\u043e\u0437\u0432\u0438\u0442\u043e\u043a \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443;","\u0444\u043e\u0440\u043c\u0443\u0432\u0430\u043d\u043d\u044f \u0442\u0430 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u043a\u0430 HR-\u0431\u0440\u0435\u043d\u0434\u0443;","\u043f\u0456\u0434\u0442\u0440\u0438\u043c\u043a\u0430 \u043a\u0435\u0440\u0456\u0432\u043d\u0438\u043a\u0456\u0432 \u043f\u0456\u0434\u0440\u043e\u0437\u0434\u0456\u043b\u0456\u0432 \u0443 \u043f\u0438\u0442\u0430\u043d\u043d\u044f\u0445 HR \u0442\u043e\u0449\u043e.","\u0417\u0430 \u043a\u043e\u0436\u043d\u043e\u044e \u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0446\u0456\u0454\u044e \u0443 \u043d\u0430\u0441 \u0454 \u043d\u0430\u0448\u0456 \u0432\u043b\u0430\u0441\u043d\u0456 \u0435\u043a\u0441\u043f\u0435\u0440\u0442\u0438, \u044f\u043a\u0456 \u043c\u0430\u044e\u0442\u044c \u0437\u043d\u0430\u0447\u043d\u0438\u0439 \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u043d\u0438\u0439 \u0434\u043e\u0441\u0432\u0456\u0434 \u0443 \u043f\u043e\u0448\u0443\u043a\u0443 \u0442\u0430 \u043f\u0456\u0434\u0431\u043e\u0440\u0456\u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0456\u0432, \u0437\u0434\u0430\u0442\u043d\u0438\u0445 \u0433\u0440\u0430\u043c\u043e\u0442\u043d\u043e \u043e\u0446\u0456\u043d\u0438\u0442\u0438 \u044f\u043a \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u0439\u043d\u0456 \u044f\u043a\u043e\u0441\u0442\u0456 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0437 \u043d\u0430\u0432\u0447\u0430\u043d\u043d\u044f \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443, \u0442\u0430\u043a \u0456 HR-\u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0430 \u0437 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443.","\u041c\u0438 \u0432\u043f\u0435\u0432\u043d\u0435\u043d\u0456, \u0449\u043e \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u0439\u043d\u0456 \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0441\u0442\u0438 \u0443 \u0441\u0444\u0435\u0440\u0456 \u0443\u043f\u0440\u0430\u0432\u043b\u0456\u043d\u043d\u044f \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u043e\u043c \u0437\u0434\u0430\u0442\u043d\u0456 \u0441\u0443\u0442\u0442\u0454\u0432\u043e \u0432\u043f\u043b\u0438\u043d\u0443\u0442\u0438 \u043d\u0430 \u043f\u043e\u043a\u0430\u0437\u043d\u0438\u043a\u0438 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457, \u0437\u0440\u043e\u0431\u0438\u0442\u0438 \u043a\u043e\u043b\u0435\u043a\u0442\u0438\u0432 \u0454\u0434\u0438\u043d\u043e\u044e \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u044e, \u0437\u043c\u0435\u043d\u0448\u0438\u0442\u0438 \u0442\u0435\u043a\u0443\u0447\u0456\u0441\u0442\u044c \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443 \u0442\u0430 \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u043e\u043f\u0442\u0438\u043c\u0430\u043b\u044c\u043d\u0443 \u0441\u0438\u0441\u0442\u0435\u043c\u0443 \u043c\u043e\u0442\u0438\u0432\u0430\u0446\u0456\u0457 \u0442\u0430 \u0430\u0434\u0430\u043f\u0442\u0430\u0446\u0456\u0457 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443."],t.i)
$.ba2=A.a(["\u0421\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0441\u0442\u0438 \u043a\u0430\u0434\u0440\u043e\u0432\u043e\u0433\u043e \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u0430 HR-Library \u0440\u0435\u0442\u0435\u043b\u044c\u043d\u043e \u043f\u0456\u0434\u0445\u043e\u0434\u044f\u0442\u044c \u0434\u043e \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u043d\u044f \u0441\u0432\u043e\u0454\u0457 \u0440\u043e\u0431\u043e\u0442\u0438, \u043d\u0435 \u0432\u0432\u0430\u0436\u0430\u044e\u0447\u0438 \u0457\u0457 \u0437\u0430\u043a\u0456\u043d\u0447\u0435\u043d\u043e\u044e \u043f\u0456\u0441\u043b\u044f \u043f\u0456\u0434\u0431\u043e\u0440\u0443 \u0442\u0430 \u043f\u0440\u0430\u0446\u0435\u0432\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0430. \u041f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u0432\u0441\u044c\u043e\u0433\u043e \u0432\u0438\u043f\u0440\u043e\u0431\u0443\u0432\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0442\u0435\u0440\u043c\u0456\u043d\u0443 \u043c\u0438 \u0441\u0443\u043f\u0440\u043e\u0432\u043e\u0434\u0436\u0443\u0454\u043c\u043e \u0439\u043e\u0433\u043e \u0442\u0430 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u044e \u043a\u043b\u0456\u0454\u043d\u0442\u0430, \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u044e\u0447\u0438, \u044f\u043a\u0456 \u0432\u0438\u043c\u043e\u0433\u0438 \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u0456, \u0430 \u044f\u043a\u0456 \u043d\u0435 \u0432\u0434\u0430\u043b\u043e\u0441\u044f \u0437\u0434\u0456\u0439\u0441\u043d\u0438\u0442\u0438 \u0442\u0430 \u0437 \u044f\u043a\u0438\u0445 \u043f\u0440\u0438\u0447\u0438\u043d. \u0414\u043b\u044f \u0446\u044c\u043e\u0433\u043e \u043e\u0431\u043e\u0432'\u044f\u0437\u043a\u043e\u0432\u043e \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u043c\u043e:","\u043a\u043e\u043d\u0441\u0443\u043b\u044c\u0442\u0430\u0446\u0456\u0439\u043d\u0456 \u0437\u0443\u0441\u0442\u0440\u0456\u0447\u0456;","\u043c\u043e\u043d\u0456\u0442\u043e\u0440\u0438\u043d\u0433 \u0432\u0438\u0440\u0456\u0448\u0435\u043d\u043d\u044f \u043f\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u0445 \u0437\u0430\u0432\u0434\u0430\u043d\u044c;","\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044e\u0454\u043c\u043e \u043f\u0440\u043e\u0446\u0435\u0441 \u0430\u0434\u0430\u043f\u0442\u0430\u0446\u0456\u0457 \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0441\u0442\u0430.","\u0422\u0430\u043a\u0438\u043c \u0447\u0438\u043d\u043e\u043c, \u043c\u0438 \u0437\u0430\u0432\u0436\u0434\u0438 \u0441\u0432\u043e\u0454\u0447\u0430\u0441\u043d\u043e \u0440\u0435\u0430\u0433\u0443\u0454\u043c\u043e \u043d\u0430 \u0437\u043c\u0456\u043d\u0443 \u0441\u0438\u0442\u0443\u0430\u0446\u0456\u0457 \u0442\u0430 \u0448\u0432\u0438\u0434\u043a\u043e \u0432\u0438\u0440\u0456\u0448\u0443\u0454\u043c\u043e \u0432\u0438\u043d\u0438\u043a\u0430\u044e\u0447\u0456 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0438. \u0423 \u043a\u0456\u043d\u0446\u0435\u0432\u043e\u043c\u0443 \u043f\u0456\u0434\u0441\u0443\u043c\u043a\u0443, \u0442\u0430\u043a\u0438\u0439 \u043f\u0456\u0434\u0445\u0456\u0434 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u043d\u0430\u043c \u0433\u0430\u0440\u0430\u043d\u0442\u0443\u0432\u0430\u0442\u0438 \u0435\u0444\u0435\u043a\u0442\u0438\u0432\u043d\u0456\u0441\u0442\u044c \u0440\u043e\u0431\u043e\u0442\u0438 \u043f\u0456\u0434\u0456\u0431\u0440\u0430\u043d\u043e\u0433\u043e \u043d\u0430\u043c\u0438 \u0441\u043f\u0456\u0432\u0440\u043e\u0431\u0456\u0442\u043d\u0438\u043a\u0430 \u0442\u0430 \u0437\u0430\u0434\u043e\u0432\u043e\u043b\u0435\u043d\u043d\u044f \u0432\u0441\u0456\u0445 \u0432\u0438\u043c\u043e\u0433 \u0440\u043e\u0431\u043e\u0442\u043e\u0434\u0430\u0432\u0446\u044f.","\u0417\u0430\u043b\u0438\u0448\u0442\u0435 \u0437\u0430\u044f\u0432\u043a\u0443, \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0441\u0442\u0438 \u043a\u0430\u0434\u0440\u043e\u0432\u043e\u0433\u043e \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u0430 HR-Library \u043f\u0456\u0434\u0431\u0435\u0440\u0443\u0442\u044c \u043a\u0432\u0430\u043b\u0456\u0444\u0456\u043a\u043e\u0432\u0430\u043d\u0438\u0445 HR-\u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0441\u0442\u0456\u0432, \u044f\u043a\u0456 \u0441\u043f\u0440\u0430\u0432\u0434\u0456 \u043b\u044e\u0431\u043b\u044f\u0442\u044c \u0456 \u0437\u043d\u0430\u044e\u0442\u044c \u0441\u0432\u043e\u044e \u0441\u043f\u0440\u0430\u0432\u0443, \u0443\u0441\u043f\u0456\u0448\u043d\u043e \u0437\u0430\u0441\u0442\u043e\u0441\u043e\u0432\u0443\u044e\u0442\u044c \u0441\u0443\u0447\u0430\u0441\u043d\u0456 \u043a\u0430\u0434\u0440\u043e\u0432\u0456 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0456\u0457."],t.i)
$.b9N=A.a(["\u0413\u043e\u043b\u043e\u0432\u043d\u0438\u0439 \u0456\u043d\u0436\u0435\u043d\u0435\u0440;","\u0406\u043d\u0436\u0435\u043d\u0435\u0440 \u041f\u0422\u041e;","\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0437 \u044f\u043a\u043e\u0441\u0442\u0456;","\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u043f\u0440\u043e\u0435\u043a\u0442\u0443;","\u041a\u0435\u0440\u0456\u0432\u043d\u0438\u043a \u0432\u0438\u0440\u043e\u0431\u043d\u0438\u0446\u0442\u0432\u0430;","\u0415\u043d\u0435\u0440\u0433\u0435\u0442\u0438\u043a;","\u0422\u0435\u0445\u043d\u0456\u0447\u043d\u0438\u0439 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440;","\u0442\u0430 \u0456\u043d\u0448\u0456."],t.i)
$.b9O=A.a(["\u0422\u043e\u0440\u0433\u0456\u0432\u043b\u044f;","\u0411\u0443\u0434\u0456\u0432\u043d\u0438\u0446\u0442\u0432\u043e;","\u0412\u0438\u0440\u043e\u0431\u043d\u0438\u0446\u0442\u0432\u043e;","\u041b\u043e\u0433\u0456\u0441\u0442\u0438\u043a\u0430;","\u0412\u0438\u0434\u043e\u0431\u0443\u0442\u043e\u043a \u0442\u0430 \u043f\u0435\u0440\u0435\u0440\u043e\u0431\u043a\u0430 \u0440\u0435\u0441\u0443\u0440\u0441\u0456\u0432;","\u0411\u0430\u043d\u043a\u0438 \u0442\u0430 \u043b\u0456\u0437\u0438\u043d\u0433\u043e\u0432\u0456 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457;","IT \u0442\u0430 \u0456\u043d\u043d\u043e\u0432\u0430\u0446\u0456\u0439\u043d\u0456 \u043e\u0440\u0433\u0430\u043d\u0456\u0437\u0430\u0446\u0456\u0457;","\u0442\u0430 \u0456\u043d\u0448\u0456."],t.i)
$.b9L=A.a(["\u0412\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u0435\u043d \u0432\u0438\u0441\u043e\u043a\u043e\u043a\u0432\u0430\u043b\u0456\u0444\u0456\u043a\u043e\u0432\u0430\u043d\u0438\u0439 \u0442\u0430 \u0434\u043e\u0441\u0432\u0456\u0434\u0447\u0435\u043d\u0438\u0439 \u0456\u043d\u0436\u0435\u043d\u0435\u0440? \u0417\u0430\u043c\u043e\u0432\u0442\u0435 \u043f\u043e\u0448\u0443\u043a \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u043e\u0433\u043e \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0441\u0442\u0430 \u0443 \u043d\u0430\u0448\u0456\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0456\u0457 \u0437\u0430 \u043d\u0430\u0439\u0432\u0438\u0433\u0456\u0434\u043d\u0456\u0448\u0438\u0445 \u0443\u043c\u043e\u0432:","\u0417\u0430 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u043e\u044e \u0442\u0430 \u043f\u043e\u0432\u043d\u0456\u0441\u0442\u044e \u043e\u0431\u0491\u0440\u0443\u043d\u0442\u043e\u0432\u0430\u043d\u043e\u044e \u0446\u0456\u043d\u043e\u044e;","\u041e\u043f\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u043e;","\u0417 \u043e\u0444\u0456\u0446\u0456\u0439\u043d\u0438\u043c\u0438 \u0433\u0430\u0440\u0430\u043d\u0442\u0456\u044f\u043c\u0438;","\u041f\u043e\u0432\u043d\u043e\u0446\u0456\u043d\u043d\u0438\u043c \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0442\u0438\u0432\u043d\u0438\u043c \u0441\u0443\u043f\u0440\u043e\u0432\u043e\u0434\u043e\u043c \u043d\u0430 \u0432\u0441\u0456\u0445 \u0435\u0442\u0430\u043f\u0430\u0445 \u043f\u043e\u0448\u0443\u043a\u0443, \u0432\u0456\u0434\u0431\u043e\u0440\u0443 \u0442\u0430 \u043f\u0440\u043e\u0445\u043e\u0434\u0436\u0435\u043d\u043d\u044f \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u043e\u043c \u0432\u0438\u043f\u0440\u043e\u0431\u0443\u0432\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0442\u0435\u0440\u043c\u0456\u043d\u0443.","\u041c\u0438 \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0438\u043c\u043e \u0435\u0444\u0435\u043a\u0442\u0438\u0432\u043d\u0443 \u0435\u043a\u043e\u043d\u043e\u043c\u0456\u044e, \u044f\u043a \u0447\u0430\u0441\u043e\u0432\u043e\u0433\u043e, \u0442\u0430\u043a \u0456 \u043c\u0430\u0442\u0435\u0440\u0456\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0440\u0435\u0441\u0443\u0440\u0441\u0443, \u043f\u043e\u0437\u0431\u0430\u0432\u0438\u043c\u043e \u0412\u0430\u0441 \u0456 \u0412\u0430\u0448\u0438\u0445 \u043a\u0430\u0434\u0440\u043e\u0432\u0438\u043a\u0456\u0432 \u0432\u0456\u0434 \u0431\u0443\u0434\u044c-\u044f\u043a\u0438\u0445 \u043c\u043e\u0436\u043b\u0438\u0432\u0438\u0445 \u0440\u0438\u0437\u0438\u043a\u0456\u0432, \u043d\u0435\u0432\u0434\u0430\u0447 \u0447\u0438 \u043f\u043e\u043c\u0438\u043b\u043e\u043a.","\u041d\u0430\u0448\u0456 \u0434\u043e\u0441\u0432\u0456\u0434\u0447\u0435\u043d\u0456 \u0440\u0435\u043a\u0440\u0443\u0442\u0435\u0440\u0438 \u0437\u0430\u0441\u0442\u043e\u0441\u043e\u0432\u0443\u044e\u0442\u044c \u043d\u0430\u0439\u043a\u0440\u0430\u0449\u0456 \u0441\u0432\u0456\u0442\u043e\u0432\u0456 \u043f\u0440\u0430\u043a\u0442\u0438\u043a\u0438 \u0456 \u043c\u0435\u0442\u043e\u0434\u0438\u043a\u0438 \u0432\u0456\u0434\u0431\u043e\u0440\u0443 \u043f\u0440\u043e\u0444\u0456\u043b\u044c\u043d\u0438\u0445 \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u0456\u0441\u0442\u0456\u0432, \u0442\u043e\u043c\u0443 \u043d\u0430\u0448\u0438\u043c \u043a\u043b\u0456\u0454\u043d\u0442\u0430\u043c \u043c\u0438 \u043d\u0430\u0434\u0430\u0454\u043c\u043e \u043b\u0438\u0448\u0435 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448 \u0433\u0456\u0434\u043d\u0438\u0445 \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0456\u0432.","\u0412\u043b\u0430\u0441\u043d\u0430 \u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0430 \u0431\u0430\u0437\u0430 \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0456\u0432 \u0456 \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u0438\u0439 \u043c\u043e\u043d\u0456\u0442\u043e\u0440\u0438\u043d\u0433 \u0440\u0438\u043d\u043a\u0443 \u043f\u0440\u0430\u0446\u0456 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u043d\u0430\u043c \u0441\u0432\u043e\u0454\u0447\u0430\u0441\u043d\u043e \u0432\u0456\u0434\u0431\u0438\u0440\u0430\u0442\u0438 \u0442\u0456\u043b\u044c\u043a\u0438 \u043d\u0430\u0439\u043a\u0440\u0430\u0449\u0438\u0445 \u043f\u0440\u043e\u0444\u0435\u0441\u0456\u043e\u043d\u0430\u043b\u0456\u0432, \u043f\u0440\u0438\u0447\u043e\u043c\u0443 \u0432 \u0440\u0435\u043a\u043e\u0440\u0434\u043d\u043e \u043a\u043e\u0440\u043e\u0442\u043a\u0456 \u0442\u0435\u0440\u043c\u0456\u043d\u0438.","\u042f\u043a\u0449\u043e \u0412\u0438 \u0432\u0436\u0435 \u0433\u043e\u0442\u043e\u0432\u0456 \u0437\u0430\u043f\u0440\u043e\u043f\u043e\u043d\u0443\u0432\u0430\u0442\u0438 \u0440\u043e\u0431\u043e\u0442\u0443 \u0456\u043d\u0436\u0435\u043d\u0435\u0440\u043e\u043c \u043f\u043e\u0442\u0435\u043d\u0446\u0456\u0439\u043d\u0438\u043c \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0430\u043c, \u0437\u0430\u043f\u043e\u0432\u043d\u0456\u0442\u044c \u0437\u0430\u044f\u0432\u043a\u0443 \u043d\u0430 \u0434\u0437\u0432\u0456\u043d\u043e\u043a."],t.i)
$.b9M=A.a(["\u0410\u0431\u0441\u043e\u043b\u044e\u0442\u043d\u0430 \u043a\u043e\u043d\u0444\u0456\u0434\u0435\u043d\u0446\u0456\u0439\u043d\u0456\u0441\u0442\u044c","\u041c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e \u0437\u0431\u0456\u043b\u044c\u0448\u0435\u043d\u0456 \u043c\u043e\u0436\u043b\u0438\u0432\u043e\u0441\u0442\u0456 \u043f\u043e\u0448\u0443\u043a\u0443 \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0444\u0456","\u042f\u043a\u0449\u043e \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u0438\u0439 \u0456\u043d\u0436\u0435\u043d\u0435\u0440 \u0431\u0435\u0437 \u0434\u043e\u0441\u0432\u0456\u0434\u0443 \u0440\u043e\u0431\u043e\u0442\u0438, \u043c\u0438 \u0433\u043e\u0442\u043e\u0432\u0456 \u043f\u0440\u043e\u0432\u0435\u0441\u0442\u0438 \u0432\u0456\u0434\u0431\u0456\u0440 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u0445 \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0456\u0432 \u0441\u0435\u0440\u0435\u0434 \u0432\u0438\u043f\u0443\u0441\u043a\u043d\u0438\u043a\u0456\u0432 \u043a\u0440\u0430\u0449\u0438\u0445 \u0412\u041d\u0417","\u0411\u0435\u0437\u043a\u043e\u0448\u0442\u043e\u0432\u043d\u0438\u0439 \u0430\u043d\u0430\u043b\u0456\u0437 \u043f\u043e\u0442\u043e\u0447\u043d\u043e\u0457 \u0441\u0438\u0442\u0443\u0430\u0446\u0456\u0457 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e\u0433\u043e \u043d\u0430\u043f\u0440\u044f\u043c\u043a\u0443 \u043d\u0430 \u0440\u0438\u043d\u043a\u0443 \u043f\u0440\u0430\u0446\u0456, \u043c\u043e\u043d\u0456\u0442\u043e\u0440\u0438\u043d\u0433 \u0437\u0430\u0440\u043f\u043b\u0430\u0442, \u043f\u0440\u0435\u043c\u0456\u0439, \u0431\u043e\u043d\u0443\u0441\u0456\u0432 \u0434\u043b\u044f \u0441\u043e\u0438\u0441\u043a\u0430\u0442\u0435\u043b\u0435\u0439 \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u043e\u0433\u043e \u0440\u0456\u0432\u043d\u044f","\u041f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0430 \u0434\u043e\u0441\u0442\u043e\u0432\u0456\u0440\u043d\u043e\u0441\u0442\u0456 \u043d\u0430\u0434\u0430\u043d\u0438\u0445 \u0441\u043e\u0438\u0441\u043a\u0430\u0442\u0435\u043b\u0435\u043c \u0434\u0430\u043d\u0438\u0445, \u0432 \u0442\u043e\u043c\u0443 \u0447\u0438\u0441\u043b\u0456 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0430\u0446\u0456\u0439\u043d\u0438\u0445 \u043b\u0438\u0441\u0442\u0456\u0432 \u0437 \u043f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u0456\u0445 \u043c\u0456\u0441\u0446\u044c \u043f\u0440\u0430\u0446\u0435\u0432\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f, \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0430 \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0456\u0432 \u0432\u043b\u0430\u0441\u043d\u0438\u043c \u0441\u043b\u0443\u0436\u0431\u043e\u044e \u0431\u0435\u0437\u043f\u0435\u043a\u0438"],t.i)
$.b9F=A.a(["\u043f\u0440\u043e\u0440\u0430\u0431;","\u0456\u043d\u0436\u0435\u043d\u0435\u0440 \u041f\u0422\u041e;","\u043a\u0430\u0434\u0430\u0441\u0442\u0440\u043e\u0432\u0438\u0439 \u0456\u043d\u0436\u0435\u043d\u0435\u0440;","\u0456\u043d\u0436\u0435\u043d\u0435\u0440-\u043f\u0440\u043e\u0435\u043a\u0442\u0443\u0432\u0430\u043b\u044c\u043d\u0438\u043a;","\u0456\u043d\u0436\u0435\u043d\u0435\u0440-\u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0442\u043e\u0440;","\u0413\u0406\u041f \u0442\u0430 \u0413\u0410\u041f;","\u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440 \u0437 \u0431\u0443\u0434\u0456\u0432\u043d\u0438\u0446\u0442\u0432\u0430;","\u0433\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u0438\u0439 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440."],t.i)
